--
-- Table structure for table `planet`
--

DROP TABLE IF EXISTS `planet`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `planet` (
  `X` smallint(5) unsigned NOT NULL AUTO_INCREMENT,
  `Y` smallint(5) unsigned NOT NULL,
  `Position` tinyint(3) unsigned NOT NULL,
  `User` varchar(32) DEFAULT NULL,
  `Name` varchar(32) NOT NULL,
  `Metal` float unsigned NOT NULL DEFAULT '0',
  `Cristal` float unsigned NOT NULL DEFAULT '0',
  `Deuter` float unsigned NOT NULL DEFAULT '0',
  `Antimatter` float unsigned NOT NULL DEFAULT '0',
  `UpdateTime` datetime NOT NULL,
  `MetalDebris` float unsigned NOT NULL DEFAULT '0',
  `CristalDebris` float unsigned NOT NULL DEFAULT '0',
  `MetalMine` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `CristalMine` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `DeuterExt` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `MetalMag` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `CristalMag` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `DeuterMag` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `AntimatterMag` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `Fusion` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `SolarSats` int(10) unsigned NOT NULL DEFAULT '0',
  `Accelerator` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `AcceleratorMode` enum('MK','MD','MA','KM','KD','KA','DM','DK','DA') NOT NULL DEFAULT 'MA',
  `Robot` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `Nanit` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `Shipyard` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `Observatory` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `Laboratory` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `ResearchNet` tinyint(1) NOT NULL DEFAULT '0',
  `RocketLauncher` int(10) unsigned NOT NULL DEFAULT '0',
  `LaserGun` int(10) unsigned NOT NULL DEFAULT '0',
  `TurboLaserGun` int(10) unsigned NOT NULL DEFAULT '0',
  `IonGun` int(10) unsigned NOT NULL DEFAULT '0',
  `TractorGun` int(10) unsigned NOT NULL DEFAULT '0',
  `PlasmaGun` int(10) unsigned NOT NULL DEFAULT '0',
  `RayShield` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `HeavyPlasmaGun` int(10) unsigned NOT NULL DEFAULT '0',
  `Transporter` int(10) unsigned NOT NULL DEFAULT '0',
  `Freighter` int(10) unsigned NOT NULL DEFAULT '0',
  `Recycler` int(10) unsigned NOT NULL DEFAULT '0',
  `SpySond` int(10) unsigned NOT NULL DEFAULT '0',
  `Colonizer` int(10) unsigned NOT NULL DEFAULT '0',
  `Fighter` int(10) unsigned NOT NULL DEFAULT '0',
  `IonFighter` int(10) unsigned NOT NULL DEFAULT '0',
  `Frigate` int(10) unsigned NOT NULL DEFAULT '0',
  `Bomber` int(10) unsigned NOT NULL DEFAULT '0',
  `Cruiser` int(10) unsigned NOT NULL DEFAULT '0',
  `Drednot` int(10) unsigned NOT NULL DEFAULT '0',
  `Destroyer` int(10) unsigned NOT NULL DEFAULT '0',
  `DeathStar` int(10) unsigned NOT NULL DEFAULT '0',
  `QueueWaiting` tinyint(1) NOT NULL DEFAULT '1',
  `GUI` tinyint(3) unsigned NOT NULL,
  `EconomyPoints` float unsigned NOT NULL DEFAULT '0',
  `MilitaryPoints` float unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`X`,`Y`,`Position`),
  KEY `User_idx` (`User`),
  CONSTRAINT `Star` FOREIGN KEY (`X`, `Y`) REFERENCES `star` (`X`, `Y`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `User` FOREIGN KEY (`User`) REFERENCES `user` (`Nick`) ON DELETE SET NULL ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=1964 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

