DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `addEmptyPlanet`(planetX smallint, planetY smallint, name varchar(32), gui tinyint) RETURNS int(11)
BEGIN
	SET @Position = IF(NOT EXISTS(select * from Planet where X = planetX and Y = planetY),
					1,
                    1 + (select Position from Planet where X = planetX and Y = planetY order by Position desc limit 1) );
	insert into Planet(X, Y, Position, Name, GUI, UpdateTime) values (planetX, planetY, @Position, name, gui, NOW());
    RETURN @Position;
END ;;
DELIMITER ;
