DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `availableEnergy`(x_ smallint, y_ smallint, position_ smallint, location_ ENUM('P','M')) RETURNS int(11)
BEGIN
	SET @SolarSatEnergy = solarSatEnergy(x_, y_, position_);
	SET @EnergySupply = IF(location_ = 'P', 
					 buildingProductivity(x_, y_, position_, location_, 'Fusion') + 
                     (select SolarSats from Planet where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_) * @SolarSatEnergy,
                     (select SolarSats from Moon   where Moon.X = x_   and Moon.Y   = y_ and Moon.Position   = position_) * @SolarSatEnergy );
    SET @EnergyUse = IF(location_ = 'P',
					   buildingCostCurrentLvl(x_, y_, position_, location_, 'E', 'MetalMine'  ) + 
                       buildingCostCurrentLvl(x_, y_, position_, location_, 'E', 'CristalMine') + 
                       buildingCostCurrentLvl(x_, y_, position_, location_, 'E', 'DeuterExt'  ) + 
                       buildingCostCurrentLvl(x_, y_, position_, location_, 'E', 'Accelerator') + 
                       buildingCostCurrentLvl(x_, y_, position_, location_, 'E', 'Robot'      ) + 
                       buildingCostCurrentLvl(x_, y_, position_, location_, 'E', 'Nanit'      ) + 
                       buildingCostCurrentLvl(x_, y_, position_, location_, 'E', 'Shipyard'   ), 
                       
                       buildingCostCurrentLvl(x_, y_, position_, location_, 'E', 'Robot'      ) + 
                       buildingCostCurrentLvl(x_, y_, position_, location_, 'E', 'Nanit'      ) + 
                       buildingCostCurrentLvl(x_, y_, position_, location_, 'E', 'Shipyard'   ) );
	RETURN @EnergySupply - @EnergyUse + 1;
END ;;
DELIMITER ;
