CREATE DEFINER=`root`@`localhost` FUNCTION `buildingCostCurrentLvl`(x_ smallint, y_ smallint, position_ smallint, location_ ENUM('P','M'), surowiec_ ENUM('M','K','D','A','E'), building_ varchar(32)) RETURNS int(11)
BEGIN
    SET @PowConst1  = (select PowConst1  from Building_Research_Cost where Item = building_);
    SET @PowCoeff1  = (select PowCoeff1  from Building_Research_Cost where Item = building_);
    SET @PowConst2  = (select PowConst2  from Building_Research_Cost where Item = building_);
    SET @PowCoeff2  = (select PowCoeff2  from Building_Research_Cost where Item = building_);
    SET @ExpConst1  = (select ExpConst1  from Building_Research_Cost where Item = building_);
    SET @ExpCoeff1  = (select ExpCoeff1  from Building_Research_Cost where Item = building_);
    SET @ExpConst2  = (select ExpConst2  from Building_Research_Cost where Item = building_);
    SET @ExpCoeff2  = (select ExpCoeff2  from Building_Research_Cost where Item = building_);
    SET @BuildingLvl = buildingLvl(x_, y_, position_, location_, building_);
    
    SET @ExpPart1 = IF(@BuildingLvl = '0', 0, @ExpConst1 * POW(@ExpCoeff1, @BuildingLvl - 1));
    SET @ExpPart2 = IF(@BuildingLvl = '0', 0, @ExpConst2 * POW(@ExpCoeff2, @BuildingLvl - 1));
    
    SET @MaterialCoeff =    IF(surowiec_ = 'M', (select MetalCoeff      from Building_Research_Cost where Item = building_),
							IF(surowiec_ = 'K', (select CristalCoeff    from Building_Research_Cost where Item = building_),
                            IF(surowiec_ = 'D', (select DeuterCoeff     from Building_Research_Cost where Item = building_),
                            IF(surowiec_ = 'A', (select AntimatterCoeff from Building_Research_Cost where Item = building_),
                            IF(surowiec_ = 'E', (select EnergyCoeff     from Building_Research_Cost where Item = building_),
                            -1)))));
	SET @SpeedRate = IF(surowiec_ = 'E', (select Value from Other_Consts where Id = 'SpeedRate'), 1);
    
	RETURN (@PowConst1 * POW(@BuildingLvl, @PowCoeff1) + 
			@PowConst2 * POW(@BuildingLvl, @PowCoeff2) + 
			@ExpPart1 + 
            @ExpPart2) * @MaterialCoeff * @SpeedRate;
END ;;
