CREATE DEFINER=`root`@`localhost` FUNCTION `buildingEnabled`(x_ smallint, y_ smallint, position_ smallint, location_ ENUM('P','M'), building_ varchar(32)) RETURNS int(11)
BEGIN    
    SET @Energetic       = researchLvl(x_, y_, position_, 'Energetic'      );
    SET @Nanotechnology  = researchLvl(x_, y_, position_, 'Nanotechnology' );
    SET @Astrophysics    = researchLvl(x_, y_, position_, 'Astrophysics'   );
    SET @Hyperspace      = researchLvl(x_, y_, position_, 'Hyperspace'     );
    SET @Astronavigation = researchLvl(x_, y_, position_, 'Astronavigation');
    SET @Shield          = researchLvl(x_, y_, position_, 'Shield'         );
    
    SET @EnergeticRequired       = (select Energetic       from Building_Reqs where Building_Reqs.Building = building_);
    SET @NanotechnologyRequired  = (select Nanotechnology  from Building_Reqs where Building_Reqs.Building = building_);
    SET @AstrophysicsRequired    = (select Astrophysics    from Building_Reqs where Building_Reqs.Building = building_);
    SET @HyperspaceRequired      = (select Hyperspace      from Building_Reqs where Building_Reqs.Building = building_);
    SET @AstronavigationRequired = (select Astronavigation from Building_Reqs where Building_Reqs.Building = building_);
    SET @ShieldRequired          = (select Shield          from Building_Reqs where Building_Reqs.Building = building_);
    
	RETURN IF(((location_ = 'P' and (building_ = 'MetalMine'     or
								     building_ = 'CristalMine'   or
                                     building_ = 'DeuterExt'     or
                                     building_ = 'Fusion'        or
                                     building_ = 'Accelerator'   or
                                     building_ = 'MetalMag'      or
                                     building_ = 'CristalMag'    or
                                     building_ = 'DeuterMag'     or
                                     building_ = 'AntimatterMag' or
                                     building_ = 'Robot'         or
                                     building_ = 'Nanit'         or
                                     building_ = 'Shipyard'      or
                                     building_ = 'Observatory'   or
                                     building_ = 'Laboratory'    or
                                     building_ = 'ResearchNet'   or
                                     building_ = 'RayShield') )  or
                                   
			  (location_ = 'M' and (building_ = 'MoonObservatory' or
								    building_ = 'OrbitalShipyard' or
                                    building_ = 'Teleporter'      or
                                    building_ = 'MetalMag'        or
                                    building_ = 'CristalMag'      or
                                    building_ = 'DeuterMag'       or
                                    building_ = 'AntimatterMag'   or
								    building_ = 'Robot'           or
                                    building_ = 'Nanit'           or
                                    building_ = 'Shipyard') ) )  and
                                   
			  @Energetic       >= @EnergeticRequired       and
			  @Nanotechnology  >= @NanotechnologyRequired  and
              @Astrophysics    >= @AstrophysicsRequired    and
              @Hyperspace      >= @HyperspaceRequired      and
              @Astronavigation >= @AstronavigationRequired and
              @Shield          >= @ShieldRequired,
              1, 0);
END ;;
