CREATE DEFINER=`root`@`localhost` FUNCTION `buildingEnoughMaterials`(x_ smallint, y_ smallint, position_ smallint, location_ ENUM('P','M'), building_ varchar(32)) RETURNS int(11)
BEGIN
	SET @Metal = IF(location_ = 'P',
				(select Metal from Planet where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_),
                (select Metal from Moon   where Moon.X   = x_ and Moon.Y   = y_ and Moon.Position   = position_) );
	SET @Cristal = IF(location_ = 'P',
				(select Cristal from Planet where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_),
                (select Cristal from Moon   where Moon.X   = x_ and Moon.Y   = y_ and Moon.Position   = position_) );
	SET @Deuter = IF(location_ = 'P',
				(select Deuter from Planet where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_),
                (select Deuter from Moon   where Moon.X   = x_ and Moon.Y   = y_ and Moon.Position   = position_) );
	SET @Antimatter = IF(location_ = 'P',
				(select Antimatter from Planet where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_),
                (select Antimatter from Moon   where Moon.X   = x_ and Moon.Y   = y_ and Moon.Position   = position_) );
	
	SET @AvailableEnergy = availableEnergy(x_, y_, position_, location_);
	SET @RequiredEnergy = buildingCost(x_, y_, position_, location_, 'E', building_) - buildingCostCurrentLvl(x_, y_, position_, location_, 'E', building_);
    
    RETURN IF(@Metal      >= buildingCost(x_, y_, position_, location_, 'M', building_) and
			  @Cristal    >= buildingCost(x_, y_, position_, location_, 'K', building_) and
              @Deuter     >= buildingCost(x_, y_, position_, location_, 'D', building_) and
              @Antimatter >= buildingCost(x_, y_, position_, location_, 'A', building_) and
              @AvailableEnergy >= @RequiredEnergy,
              1, 0);
END ;;
