CREATE DEFINER=`root`@`localhost` FUNCTION `buildingLvl`(x_ smallint, y_ smallint, position_ smallint, location_ ENUM('P','M'), building_ varchar(32) ) RETURNS int(11)
BEGIN
	RETURN  IF(location_ = 'P', 
			IF(building_ = 'MetalMine',     (select MetalMine     from Planet where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_),
            IF(building_ = 'CristalMine',   (select CristalMine   from Planet where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_),
            IF(building_ = 'DeuterExt',     (select DeuterExt     from Planet where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_),
            IF(building_ = 'Fusion',        (select Fusion        from Planet where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_),
            IF(building_ = 'Accelerator',   (select Accelerator   from Planet where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_),
            IF(building_ = 'MetalMag',      (select MetalMag      from Planet where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_),
            IF(building_ = 'CristalMag',    (select CristalMag    from Planet where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_),
            IF(building_ = 'DeuterMag',     (select DeuterMag     from Planet where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_),
            IF(building_ = 'AntimatterMag', (select AntimatterMag from Planet where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_),
            IF(building_ = 'Robot',         (select Robot         from Planet where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_),
            IF(building_ = 'Nanit',         (select Nanit         from Planet where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_),
            IF(building_ = 'Shipyard',      (select Shipyard      from Planet where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_),
            IF(building_ = 'Observatory',   (select Observatory   from Planet where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_),
            IF(building_ = 'Laboratory',    (select Laboratory    from Planet where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_),
            IF(building_ = 'ResearchNet',   (select ResearchNet   from Planet where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_),
            IF(building_ = 'RayShield',     (select RayShield     from Planet where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_),
            -1)))))))))))))))), 
            
            
            IF(building_ = 'MoonObservatory', (select MoonObservatory from Moon where Moon.X = x_ and Moon.Y = y_ and Moon.Position = position_),
            IF(building_ = 'OrbitalShipyard', (select OrbitalShipyard from Moon where Moon.X = x_ and Moon.Y = y_ and Moon.Position = position_),
            IF(building_ = 'Teleporter',      (select Teleporter      from Moon where Moon.X = x_ and Moon.Y = y_ and Moon.Position = position_),
            IF(building_ = 'Robot',           (select Robot           from Moon where Moon.X = x_ and Moon.Y = y_ and Moon.Position = position_),
            IF(building_ = 'Nanit',           (select Nanit           from Moon where Moon.X = x_ and Moon.Y = y_ and Moon.Position = position_),
            IF(building_ = 'Shipyard',        (select Shipyard        from Moon where Moon.X = x_ and Moon.Y = y_ and Moon.Position = position_),
            IF(building_ = 'MetalMag',        (select MetalMag        from Moon where Moon.X = x_ and Moon.Y = y_ and Moon.Position = position_),
            IF(building_ = 'CristalMag',      (select CristalMag      from Moon where Moon.X = x_ and Moon.Y = y_ and Moon.Position = position_),
            IF(building_ = 'DeuterMag',       (select DeuterMag       from Moon where Moon.X = x_ and Moon.Y = y_ and Moon.Position = position_),
            IF(building_ = 'AntimatterMag',   (select AntimatterMag   from Moon where Moon.X = x_ and Moon.Y = y_ and Moon.Position = position_),
            -1))))))))))); 
END ;;
