CREATE DEFINER=`root`@`localhost` FUNCTION `buildingNextLvlProductivity`(x_ smallint, y_ smallint, position_ smallint, location_ ENUM('P','M'), building_ varchar(32)) RETURNS int(11)
BEGIN
	SET @User       = (select User       from Planet where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_);
    SET @PowConst1  = (select PowConst1  from Building_Productivity where Building = building_);
    SET @PowCoeff1  = (select PowCoeff1  from Building_Productivity where Building = building_);
    SET @PowConst2  = (select PowConst2  from Building_Productivity where Building = building_);
    SET @PowCoeff2  = (select PowCoeff2  from Building_Productivity where Building = building_);
    SET @ExpConst1  = (select ExpConst1  from Building_Productivity where Building = building_);
    SET @ExpCoeff1  = (select ExpCoeff1  from Building_Productivity where Building = building_);
    SET @ExpConst2  = (select ExpConst2  from Building_Productivity where Building = building_);
    SET @ExpCoeff2  = (select ExpCoeff2  from Building_Productivity where Building = building_);
    SET @TechCoeff  = (select TechCoeff  from Building_Productivity where Building = building_);
	SET @Technology = (select Technology from Building_Productivity where Building = building_);
    SET @BuildingLvl = buildingLvl(x_, y_, position_, location_, building_) + 1;
    SET @ResearchLvl = researchLvl(x_, y_, position_, @Technology);
    
    SET @ExpPart1 = IF(@BuildingLvl = '0', '0', @ExpConst1 * POW(@ExpCoeff1, @BuildingLvl) );
    SET @ExpPart2 = IF(@BuildingLvl = '0', '0', @ExpConst2 * POW(@ExpCoeff2, @BuildingLvl) );

	SET @SpeedRate = (select Value from Other_Consts where Id = 'SpeedRate');
    
	RETURN  IF(IS_NULL(@User), 0, 
		   (@PowConst1 * POW(@BuildingLvl, @PowCoeff1) + 
            @PowConst2 * POW(@BuildingLvl, @PowCoeff2) + 
            @ExpPart1 + 
            @ExpPart2 ) 
            * (1 + @ResearchLvl * @TechCoeff) * @SpeedRate ); 
END ;;
