CREATE DEFINER=`root`@`localhost` FUNCTION `buildingTime`(x_ smallint, y_ smallint, position_ smallint, location_ ENUM('P','M'), building_ varchar(32) ) RETURNS varchar(32) CHARSET utf8
BEGIN
	SET @Cost = buildingCost(x_, y_, position_, location_, 'M', building_) + 
				buildingCost(x_, y_, position_, location_, 'K', building_) + 
                buildingCost(x_, y_, position_, location_, 'D', building_) + 
                buildingCost(x_, y_, position_, location_, 'A', building_);
	SET @SpeedRate = (select Value from Other_Consts where Id = 'SpeedRate');
    SET @Productivity = buildingProductivity(x_, y_, position_, location_, 'Robot') + buildingProductivity(x_, y_, position_, location_, 'Nanit');
	RETURN IF(@Productivity = '0', "NN:NN:NN", TIME_FORMAT(SEC_TO_TIME(3600 / @SpeedRate * @Cost / @Productivity ), '%T'));
END ;;
