CREATE DEFINER=`root`@`localhost` FUNCTION `flightFuel`(x1_ smallint,
							  y1_ smallint, 
                              position1_ smallint,
                              x2_ smallint,
                              y2_ smallint,
                              position2_ smallint,
                              transporter_ integer,
                              freighter_ integer,
                              recycler_ integer,
                              colonizer_ integer,
                              spySond_ integer,
                              fighter_ integer,
                              ionFighter_ integer,
                              frigate_ integer,
                              bomber_ integer,
                              cruiser_ integer,
                              drednot_ integer,
                              destroyer_ integer,
                              deathStar_ integer,
                              speed_ float) RETURNS int(11)
BEGIN
	SET @Speed = flightSpeed(x1_, y1_, position1_, 
                            transporter_, 
                            freighter_, 
                            recycler_, 
                            colonizer_, 
                            spySond_, 
                            fighter_, 
                            ionFighter_, 
                            frigate_, 
                            bomber_, 
                            cruiser_, 
                            drednot_, 
                            destroyer_, 
                            deathStar_,
                            speed_);
                            
	SET @EngineLvl   = researchLvl(x1_, y1_, position1_, 'HyperEngine');
    SET @EngineBonus = 1 + @EngineLvl * (select Value from Other_Consts where Id = 'HyperBonus');
                            
	SET @Time_ = TIME_TO_SEC(flightTime(x1_, y1_, position1_, 
                            x2_, y2_, position2_, 
                            transporter_, 
                            freighter_, 
                            recycler_, 
                            colonizer_, 
                            spySond_, 
                            fighter_, 
                            ionFighter_, 
                            frigate_, 
                            bomber_, 
                            cruiser_, 
                            drednot_, 
                            destroyer_, 
                            deathStar_,
                            speed_) );
                            
	RETURN (transporter_  * (select Fuel from Ship_Params where Item = 'Transporter') * @Time_ * POW(@Speed / ((select Speed from Ship_Params where Item = 'Transporter') * @EngineBonus ),2) + 
		    freighter_    * (select Fuel from Ship_Params where Item = 'Freighter')   * @Time_ * POW(@Speed / ((select Speed from Ship_Params where Item = 'Freighter'  ) * @EngineBonus ),2) + 
            recycler_     * (select Fuel from Ship_Params where Item = 'Recycler')    * @Time_ * POW(@Speed / ((select Speed from Ship_Params where Item = 'Recycler'   ) * @EngineBonus ),2) + 
            colonizer_    * (select Fuel from Ship_Params where Item = 'Colonizer')   * @Time_ * POW(@Speed / ((select Speed from Ship_Params where Item = 'Colonizer'  ) * @EngineBonus ),2) + 
            spySond_      * (select Fuel from Ship_Params where Item = 'SpySond')     * @Time_ * POW(@Speed / ((select Speed from Ship_Params where Item = 'SpySond'    ) * @EngineBonus ),2) + 
            fighter_      * (select Fuel from Ship_Params where Item = 'Fighter')     * @Time_ * POW(@Speed / ((select Speed from Ship_Params where Item = 'Fighter'    ) * @EngineBonus ),2) + 
            ionFighter_   * (select Fuel from Ship_Params where Item = 'IonFighter')  * @Time_ * POW(@Speed / ((select Speed from Ship_Params where Item = 'IonFighter' ) * @EngineBonus ),2) + 
            frigate_      * (select Fuel from Ship_Params where Item = 'Frigate')     * @Time_ * POW(@Speed / ((select Speed from Ship_Params where Item = 'Frigate'    ) * @EngineBonus ),2) + 
            bomber_       * (select Fuel from Ship_Params where Item = 'Bomber')      * @Time_ * POW(@Speed / ((select Speed from Ship_Params where Item = 'Bomber'     ) * @EngineBonus ),2) + 
            cruiser_      * (select Fuel from Ship_Params where Item = 'Cruiser')     * @Time_ * POW(@Speed / ((select Speed from Ship_Params where Item = 'Cruiser'    ) * @EngineBonus ),2) + 
            drednot_      * (select Fuel from Ship_Params where Item = 'Drednot')     * @Time_ * POW(@Speed / ((select Speed from Ship_Params where Item = 'Drednot'    ) * @EngineBonus ),2) + 
            destroyer_    * (select Fuel from Ship_Params where Item = 'Destroyer')   * @Time_ * POW(@Speed / ((select Speed from Ship_Params where Item = 'Destroyer'  ) * @EngineBonus ),2) + 
            deathStar_    * (select Fuel from Ship_Params where Item = 'DeathStar')   * @Time_ * POW(@Speed / ((select Speed from Ship_Params where Item = 'DeathStar'  ) * @EngineBonus ),2) ) / 3600 + 1 ; 
END ;;
