CREATE DEFINER=`root`@`localhost` FUNCTION `flightSpeed`(x1_ smallint,
							  y1_ smallint, 
                              position1_ smallint,
                              transporter_ integer,
                              freighter_ integer,
                              recycler_ integer,
                              colonizer_ integer,
                              spySond_ integer,
                              fighter_ integer,
                              ionFighter_ integer,
                              frigate_ integer,
                              bomber_ integer,
                              cruiser_ integer,
                              drednot_ integer,
                              destroyer_ integer,
                              deathStar_ integer,
                              speed_ float) RETURNS int(11)
BEGIN
	SET @EngineLvl   = researchLvl(x1_, y1_, position1_, 'HyperEngine');
    SET @EngineBonus = 1 + @EngineLvl * (select Value from Other_Consts where Id = 'HyperBonus');
    
	SET @TransporterSpeed = IF(transporter_ = 0,1000000000,(select Speed from Ship_Params where Item = 'Transporter') * @EngineBonus);
    SET @FreighterSpeed   = IF(freighter_   = 0,1000000000,(select Speed from Ship_Params where Item = 'Freighter'  ) * @EngineBonus);
    SET @RecyclerSpeed    = IF(recycler_    = 0,1000000000,(select Speed from Ship_Params where Item = 'Recycler'   ) * @EngineBonus);
    SET @ColonizerSpeed   = IF(colonizer_   = 0,1000000000,(select Speed from Ship_Params where Item = 'Colonizer'  ) * @EngineBonus);
    SET @SpySondSpeed     = IF(spySond_     = 0,1000000000,(select Speed from Ship_Params where Item = 'SpySond'    ) * @EngineBonus);
    SET @FighterSpeed     = IF(fighter_     = 0,1000000000,(select Speed from Ship_Params where Item = 'Fighter'    ) * @EngineBonus);
    SET @IonFighterSpeed  = IF(ionFighter_  = 0,1000000000,(select Speed from Ship_Params where Item = 'IonFighter' ) * @EngineBonus);
    SET @FrigateSpeed     = IF(frigate_     = 0,1000000000,(select Speed from Ship_Params where Item = 'Frigate'    ) * @EngineBonus);
    SET @BomberSpeed      = IF(bomber_      = 0,1000000000,(select Speed from Ship_Params where Item = 'Bomber'     ) * @EngineBonus);
    SET @CruiserSpeed     = IF(cruiser_     = 0,1000000000,(select Speed from Ship_Params where Item = 'Cruiser'    ) * @EngineBonus);
    SET @DrednotSpeed     = IF(drednot_     = 0,1000000000,(select Speed from Ship_Params where Item = 'Drednot'    ) * @EngineBonus);
    SET @DestroyerSpeed   = IF(destroyer_   = 0,1000000000,(select Speed from Ship_Params where Item = 'Destroyer'  ) * @EngineBonus);
    SET @DeathStarSpeed   = IF(deathStar_   = 0,1000000000,(select Speed from Ship_Params where Item = 'DeathStar'  ) * @EngineBonus);
    
    RETURN LEAST(@TransporterSpeed,
					   @FreighterSpeed,
                       @RecyclerSpeed,
                       @ColonizerSpeed,
                       @SpySondSpeed,
                       @FighterSpeed,
                       @IonFighterSpeed,
                       @FrigateSpeed,
                       @BomberSpeed,
                       @CruiserSpeed,
                       @DrednotSpeed,
                       @DestroyerSpeed,
                       @DeathStarSpeed) * speed_;
END ;;
DELIMITER ;
