CREATE DEFINER=`root`@`localhost` FUNCTION `flightTime`(x1_ smallint,
							  y1_ smallint, 
                              position1_ smallint,
                              x2_ smallint,
                              y2_ smallint,
                              position2_ smallint,
                              transporter_ integer,
                              freighter_ integer,
                              recycler_ integer,
                              colonizer_ integer,
                              spySond_ integer,
                              fighter_ integer,
                              ionFighter_ integer,
                              frigate_ integer,
                              bomber_ integer,
                              cruiser_ integer,
                              drednot_ integer,
                              destroyer_ integer,
                              deathStar_ integer,
                              speed_ float) RETURNS time
BEGIN
    SET @Speed = flightSpeed( x1_ ,
							  y1_ , 
                              position1_ ,
                              transporter_ ,
                              freighter_ ,
                              recycler_ ,
                              colonizer_ ,
                              spySond_ ,
                              fighter_ ,
                              ionFighter_ ,
                              frigate_ ,
                              bomber_ ,
                              cruiser_ ,
                              drednot_ ,
                              destroyer_ ,
                              deathStar_ ,
                              speed_);
                              
	SET @MinimumTime = (select Value from Other_Consts where Id = 'MinimumFlightTime');
    SET @SpeedRate = (select Value from Other_Consts where Id = 'SpeedRate');
	RETURN SEC_TO_TIME((@MinimumTime / @SpeedRate) + 3600 / @SpeedRate * planetDistance(x1_, y1_, position1_, x2_,  y2_, position2_) / @Speed);
END ;;
