CREATE DEFINER=`root`@`localhost` FUNCTION `maxDefenseItems`(x_ smallint, y_ smallint, position_ smallint, location_ ENUM('P','M'), item_ varchar(32)) RETURNS int(11)
BEGIN
	SET @Metal = IF(location_ = 'P',
				(select Metal from Planet where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_),
                (select Metal from Moon   where Moon.X   = x_ and Moon.Y   = y_ and Moon.Position   = position_) );
	SET @Cristal = IF(location_ = 'P',
				(select Cristal from Planet where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_),
                (select Cristal from Moon   where Moon.X   = x_ and Moon.Y   = y_ and Moon.Position   = position_) );
	SET @Deuter = IF(location_ = 'P',
				(select Deuter from Planet where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_),
                (select Deuter from Moon   where Moon.X   = x_ and Moon.Y   = y_ and Moon.Position   = position_) );
                
	SET @CostMetal      = (select Metal      from Defense_Params where Item = item_);
    SET @CostMetal      = IF(@CostMetal = '0', 0.01, @CostMetal);
    
    SET @CostCristal    = (select Cristal    from Defense_Params where Item = item_);
    SET @CostCristal    = IF(@CostCristal = '0', 0.01, @CostCristal);
    
    SET @CostDeuter     = (select Deuter     from Defense_Params where Item = item_);
    SET @CostDeuter     = IF(@CostDeuter = '0', 0.01, @CostDeuter);
    
    SET @MetalResult   = FLOOR(@Metal   / @CostMetal  );
    SET @CristalResult = FLOOR(@Cristal / @CostCristal);
    SET @DeuterResult  = FLOOR(@Deuter  / @CostDeuter );
    
    RETURN LEAST(@MetalResult, @CristalResult, @DeuterResult);   
END ;;
