CREATE DEFINER=`root`@`localhost` FUNCTION `planetDistance`(x1_ smallint, y1_ smallint, position1_ smallint, x2_ smallint, y2_ smallint, position2_ smallint) RETURNS float
BEGIN
	RETURN  IF( x1_ = x2_ and y1_ = y2_ and position1_ = position2_, 0,
			IF( x1_ = x2_ and y1_ = y2_, 0.001 * ABS(position1_ - position2_),
			    sqrt( pow(x1_ - x2_, 2) + pow(y1_ - y2_, 2) ) ));
END ;;
