CREATE DEFINER=`root`@`localhost` FUNCTION `researchCost`(x_ smallint, y_ smallint, position_ smallint, surowiec_ ENUM('M','K','D','A','E'), research_ varchar(32)) RETURNS int(11)
BEGIN
	SET @PowConst1  = (select PowConst1  from Building_Research_Cost where Item = research_);
    SET @PowCoeff1  = (select PowCoeff1  from Building_Research_Cost where Item = research_);
    SET @PowConst2  = (select PowConst2  from Building_Research_Cost where Item = research_);
    SET @PowCoeff2  = (select PowCoeff2  from Building_Research_Cost where Item = research_);
    SET @ExpConst1  = (select ExpConst1  from Building_Research_Cost where Item = research_);
    SET @ExpCoeff1  = (select ExpCoeff1  from Building_Research_Cost where Item = research_);
    SET @ExpConst2  = (select ExpConst2  from Building_Research_Cost where Item = research_);
    SET @ExpCoeff2  = (select ExpCoeff2  from Building_Research_Cost where Item = research_);
    SET @BuildingLvl = researchLvl(x_, y_, position_, research_);
    
    SET @MaterialCoeff =    IF(surowiec_ = 'M', (select MetalCoeff      from Building_Research_Cost where Item = research_),
							IF(surowiec_ = 'K', (select CristalCoeff    from Building_Research_Cost where Item = research_),
                            IF(surowiec_ = 'D', (select DeuterCoeff     from Building_Research_Cost where Item = research_),
                            IF(surowiec_ = 'A', (select AntimatterCoeff from Building_Research_Cost where Item = research_),
                            IF(surowiec_ = 'E', (select EnergyCoeff     from Building_Research_Cost where Item = research_),
                            -1)))));
	RETURN (@PowConst1 * POW(@BuildingLvl + 1, @PowCoeff1) + 
			@PowConst2 * POW(@BuildingLvl + 1, @PowCoeff2) + 
			@ExpConst1 * POW(@ExpCoeff1, @BuildingLvl) + 
            @ExpConst2 * POW(@ExpCoeff2, @BuildingLvl) ) * @MaterialCoeff;
END ;;
DELIMITER ;
