CREATE DEFINER=`root`@`localhost` FUNCTION `researchEnabled`(x_ smallint, y_ smallint, position_ smallint, research_ varchar(32)) RETURNS int(11)
BEGIN
	SET @Energetic       = researchLvl(x_, y_, position_, 'Energetic'       );
    SET @Nanotechnology  = researchLvl(x_, y_, position_, 'Nanotechnology'  );
    SET @Astrophysics    = researchLvl(x_, y_, position_, 'Astrophysics'    );
    SET @Hyperspace      = researchLvl(x_, y_, position_, 'Hyperspace'      );
    SET @Astronavigation = researchLvl(x_, y_, position_, 'Astronavigation' );
    SET @Laser           = researchLvl(x_, y_, position_, 'Laser'           );
    SET @Ion             = researchLvl(x_, y_, position_, 'Ion'             );
    SET @Plasma          = researchLvl(x_, y_, position_, 'Plasma'          );
    SET @Gravitons       = researchLvl(x_, y_, position_, 'Gravitons'       );
    SET @Combat          = researchLvl(x_, y_, position_, 'Combat'          );
    SET @Shield          = researchLvl(x_, y_, position_, 'Shield'          );
    SET @Material        = researchLvl(x_, y_, position_, 'Material'        );
    SET @IonEngine       = researchLvl(x_, y_, position_, 'IonEngine'       );
    SET @HyperEngine     = researchLvl(x_, y_, position_, 'HyperEngine'     );
    SET @Laboratory      = buildingLvl(x_, y_, position_, 'P', 'Laboratory' );
    SET @Observatory     = buildingLvl(x_, y_, position_, 'P', 'Observatory');
    
    SET @EnergeticRequired       = (select Energetic       from Research_Reqs where Technology = research_);
    SET @NanotechnologyRequired  = (select Nanotechnology  from Research_Reqs where Technology = research_);
    SET @AstrophysicsRequired    = (select Astrophysics    from Research_Reqs where Technology = research_);
    SET @HyperspaceRequired      = (select Hyperspace      from Research_Reqs where Technology = research_);
    SET @AstronavigationRequired = (select Astronavigation from Research_Reqs where Technology = research_);
    SET @LaserRequired           = (select Laser           from Research_Reqs where Technology = research_);
    SET @IonRequired             = (select Ion             from Research_Reqs where Technology = research_);
    SET @PlasmaRequired          = (select Plasma          from Research_Reqs where Technology = research_);
    SET @GravitonsRequired       = (select Gravitons       from Research_Reqs where Technology = research_);
    SET @CombatRequired          = (select Combat          from Research_Reqs where Technology = research_);
    SET @ShieldRequired          = (select Shield          from Research_Reqs where Technology = research_);
    SET @MaterialRequired        = (select Material        from Research_Reqs where Technology = research_);
    SET @IonEngineRequired       = (select IonEngine       from Research_Reqs where Technology = research_);
    SET @HyperEngineRequired     = (select HyperEngine     from Research_Reqs where Technology = research_);
    SET @LaboratoryRequired      = (select Laboratory      from Research_Reqs where Technology = research_);
    SET @ObservatoryRequired     = (select Observatory     from Research_Reqs where Technology = research_);
    
    RETURN IF(@Energetic       >= @EnergeticRequired       and
			  @Nanotechnology  >= @NanotechnologyRequired  and
              @Astrophysics    >= @AstrophysicsRequired    and
              @Hyperspace      >= @HyperspaceRequired      and 
              @Astronavigation >= @AstronavigationRequired and
              @Laser           >= @LaserRequired           and
              @Ion             >= @IonRequired             and
              @Plasma          >= @PlasmaRequired          and
              @Gravitons       >= @GravitonsRequired       and 
              @Combat          >= @CombatRequired          and
              @Shield          >= @ShieldRequired          and
              @Material        >= @MaterialRequired        and 
              @IonEngine       >= @IonEngineRequired       and 
              @HyperEngine     >= @HyperEngineRequired     and 
              @Laboratory      >= @LaboratoryRequired      and 
              @Observatory     >= @ObservatoryRequired,
              1, 0);
END ;;
