CREATE DEFINER=`root`@`localhost` FUNCTION `researchEnoughMaterials`(x_ smallint, y_ smallint, position_ smallint, research_ varchar(32)) RETURNS int(11)
BEGIN
	SET @Metal      = (select Metal      from Planet where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_);
	SET @Cristal    = (select Cristal    from Planet where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_);
	SET @Deuter     = (select Deuter     from Planet where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_);
	SET @Antimatter = (select Antimatter from Planet where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_);
	
	SET @AvailableEnergy = availableEnergy(x_, y_, position_, 'P');
	SET @RequiredEnergy = researchCost(x_, y_, position_, 'E', research_);
    
    RETURN IF(@Metal      >= researchCost(x_, y_, position_, 'M', research_) and
			  @Cristal    >= researchCost(x_, y_, position_, 'K', research_) and
              @Deuter     >= researchCost(x_, y_, position_, 'D', research_) and
              @Antimatter >= researchCost(x_, y_, position_, 'A', research_) and
              @AvailableEnergy >= @RequiredEnergy,
              1, 0);
END ;;
