CREATE DEFINER=`root`@`localhost` FUNCTION `researchLvl`(x_ smallint, y_ smallint, position_ smallint, tech_ varchar(32)) RETURNS int(11)
BEGIN
	SET @User = (select User from Planet where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_);
    
	RETURN  IF(IS_NULL(@User), 0, 
			IF(tech_ = 'Energetic',       (select Energetic       from User where User.Nick = @User),
            IF(tech_ = 'Nanotechnology',  (select Nanotechnology  from User where User.Nick = @User),
            IF(tech_ = 'Astrophysics',    (select Astrophysics    from User where User.Nick = @User),
            IF(tech_ = 'Hyperspace',      (select Hyperspace      from User where User.Nick = @User),
            IF(tech_ = 'Astronavigation', (select Astronavigation from User where User.Nick = @User),
            IF(tech_ = 'Laser',           (select Laser           from User where User.Nick = @User),
            IF(tech_ = 'Ion',             (select Ion             from User where User.Nick = @User),
            IF(tech_ = 'Plasma',          (select Plasma          from User where User.Nick = @User),
            IF(tech_ = 'Gravitons',       (select Gravitons       from User where User.Nick = @User),
            IF(tech_ = 'Combat',          (select Combat          from User where User.Nick = @User),
            IF(tech_ = 'Shield',          (select Shield          from User where User.Nick = @User),
            IF(tech_ = 'Material',        (select Material        from User where User.Nick = @User),
            IF(tech_ = 'IonEngine',       (select IonEngine       from User where User.Nick = @User),
            IF(tech_ = 'HyperEngine',     (select HyperEngine     from User where User.Nick = @User),
            -1)))))))))))))));
END ;;
