CREATE DEFINER=`root`@`localhost` FUNCTION `researchTime`(x_ smallint, y_ smallint, position_ smallint, research_ varchar(32)) RETURNS varchar(32) CHARSET utf8
BEGIN
	SET @User = (select User from Planet where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_);
    
	SET @Cost = researchCost(x_, y_, position_, 'M', research_) + 
				researchCost(x_, y_, position_, 'K', research_) + 
                researchCost(x_, y_, position_, 'D', research_) + 
                researchCost(x_, y_, position_, 'A', research_);
                
	SET @ResearchProductivity = 
		(select sum(Prod) from 
			(select buildingProductivity(Planet.X, Planet.Y, Planet.Position, 'P', 'Laboratory') as Prod 
				from Planet 
					where Planet.User = @User 
						and NOT EXISTS(select * from Research_Order where Research_Order.X = Planet.X and Research_Order.Y = Planet.Y and Research_Order.Position = Planet.Position)
						and planetDistance(x_, y_, position_, Planet.X, Planet.Y, Planet.Position) <= buildingProductivity(x_, y_, position_, 'P', 'ResearchNet') ) as Labs);
    SET @SpeedRate = (select Value from Other_Consts where Id = 'SpeedRate');
    RETURN IF(@ResearchProductivity = '0', "NN:NN:NN", TIME_FORMAT(SEC_TO_TIME(3600 / @SpeedRate * @Cost / @ResearchProductivity), "%T") );
    
END ;;
DELIMITER ;
