CREATE DEFINER=`root`@`localhost` FUNCTION `sendFlightPossible`(
							  x1_ smallint,
							  y1_ smallint, 
                              position1_ smallint,
                              location1_ ENUM('P','M'),
                              mission_ ENUM('T','S','K','SZ','R','A','N'),
                              x2_ smallint,
                              y2_ smallint,
                              position2_ smallint,
                              location2_ ENUM('P','M','D'),
                              transporter_ integer,
                              freighter_ integer,
                              recycler_ integer,
                              colonizer_ integer,
                              spySond_ integer,
                              fighter_ integer,
                              ionFighter_ integer,
                              frigate_ integer,
                              bomber_ integer,
                              cruiser_ integer,
                              drednot_ integer,
                              destroyer_ integer,
                              deathStar_ integer,
                              speed_ float,
                              metal_ float,
                              cristal_ float,
                              deuter_ float,
                              antimatter_ float) RETURNS int(11)
BEGIN
	SET @Metal   = IF(location1_ = 'P', 
					(select Metal from Planet where X = x1_ and Y = y1_ and Position = position1_),
                    (select Metal from Moon   where X = x1_ and Y = y1_ and Position = position1_) );
	SET @Cristal = IF(location1_ = 'P', 
				(select Cristal from Planet where X = x1_ and Y = y1_ and Position = position1_),
                (select Cristal from Moon   where X = x1_ and Y = y1_ and Position = position1_) );
	SET @Deuter  = IF(location1_ = 'P', 
				(select Deuter from Planet where X = x1_ and Y = y1_ and Position = position1_),
                (select Deuter from Moon   where X = x1_ and Y = y1_ and Position = position1_) );
	SET @Antimatter = IF(location1_ = 'P', 
				(select Antimatter from Planet where X = x1_ and Y = y1_ and Position = position1_),
                (select Antimatter from Moon   where X = x1_ and Y = y1_ and Position = position1_) );
	SET @FlightFuel = IF(mission_ = 'S',flightFuel(x1_ , y1_ , position1_ ,
													x2_ , y2_ , position2_ ,
													transporter_ , freighter_ , recycler_ , colonizer_ , spySond_ , fighter_ , ionFighter_ , frigate_ , bomber_ , cruiser_ , drednot_ , destroyer_ , deathStar_ ,
													speed_ ),
										2 * flightFuel(x1_ , y1_ , position1_ ,
													x2_ , y2_ , position2_ ,
													transporter_ , freighter_ , recycler_ , colonizer_ , spySond_ , fighter_ , ionFighter_ , frigate_ , bomber_ , cruiser_ , drednot_ , destroyer_ , deathStar_ ,
													speed_ ) );
    
	RETURN IF(flightEnoughShips(x1_ ,
						 y1_ , 
                         position1_ ,
                         location1_,
                         transporter_ ,
                         freighter_ ,
                         recycler_ ,
                         colonizer_ ,
                         spySond_ ,
                         fighter_ ,
                         ionFighter_ ,
                         frigate_ ,
                         bomber_ ,
                         cruiser_ ,
                         drednot_ ,
                         destroyer_ ,
                         deathStar_ ) and 
		  flightCapacity(transporter_ ,
                         freighter_ ,
                         recycler_ ,
                         colonizer_ ,
                         spySond_ ,
                         fighter_ ,
                         ionFighter_ ,
                         frigate_ ,
                         bomber_ ,
                         cruiser_ ,
                         drednot_ ,
                         destroyer_ ,
                         deathStar_ ) >= @FlightFuel + metal_ + cristal_ + deuter_ + antimatter_ and
                   metal_      <= @Metal      and
                   cristal_    <= @Cristal    and
                   deuter_     <= @Deuter + @FlightFuel and
                   antimatter_ <= @Antimatter and
                   planetDistance(x1_, y1_, position1_, x2_, y2_, position2_) <= researchLvl(x1_, y1_, position1_, 'Astronavigation') * (select Value from Other_Consts where Id = 'AstronavigationRange') and 
                   (
						(mission_ = 'T') or
						(mission_ = 'S'  and location2_ != 'D') or
                        (mission_ = 'K'  and colonizer_ > 0 and location2_ = 'P') or
                        (mission_ = 'SZ' and spySond_ > 0 ) or
                        (mission_ = 'R'  and recycler_ > 0 and location2_ = 'D') or
                        (mission_ = 'A'  and location2_ != 'D') or
                        (mission_ = 'N'  and deathStar_ > 0 and location2_ != 'D')
                   ),
                   '1', '0' );
END ;;
DELIMITER ;
