CREATE DEFINER=`root`@`localhost` FUNCTION `shipCost`(item_ varchar(32), material_ ENUM('M','K','D') ) RETURNS int(11)
BEGIN
	SET @Material = IF(material_ = 'M', 'Metal', IF(material_ = 'K', 'Cristal', 'Deuter') );
	RETURN (select @Material from Ship_Params where Item = item_);
END ;;
