CREATE DEFINER=`root`@`localhost` FUNCTION `shipyardEnabled`(x_ smallint, y_ smallint, position_ smallint, location_ ENUM('P','M'), item_ varchar(32)) RETURNS int(11)
BEGIN
	SET @Energetic       = researchLvl(x_, y_, position_, 'Energetic'                 );
    SET @Nanotechnology  = researchLvl(x_, y_, position_, 'Nanotechnology'            );
    SET @Astrophysics    = researchLvl(x_, y_, position_, 'Astrophysics'              );
    SET @Hyperspace      = researchLvl(x_, y_, position_, 'Hyperspace'                );
    SET @Astronavigation = researchLvl(x_, y_, position_, 'Astronavigation'           );
    SET @Laser           = researchLvl(x_, y_, position_, 'Laser'                     );
    SET @Ion             = researchLvl(x_, y_, position_, 'Ion'                       );
    SET @Plasma          = researchLvl(x_, y_, position_, 'Plasma'                    );
    SET @Gravitons       = researchLvl(x_, y_, position_, 'Gravitons'                 );
    SET @Combat          = researchLvl(x_, y_, position_, 'Combat'                    );
    SET @Shield          = researchLvl(x_, y_, position_, 'Shield'                    );
    SET @Material        = researchLvl(x_, y_, position_, 'Material'                  );
    SET @IonEngine       = researchLvl(x_, y_, position_, 'IonEngine'                 );
    SET @HyperEngine     = researchLvl(x_, y_, position_, 'HyperEngine'               );
    SET @Shipyard        = buildingLvl(x_, y_, position_, location_, 'Shipyard'       );
    SET @OrbitalShipyard = IF(location_ = 'M', buildingLvl(x_, y_, position_, location_, 'OrbitalShipyard'), 0);
    SET @Nanit           = buildingLvl(x_, y_, position_, location_, 'Nanit'          );
    
    SET @EnergeticRequired       = (select Energetic       from Ships_Defense_Reqs where Item = item_);
    SET @NanotechnologyRequired  = (select Nanotechnology  from Ships_Defense_Reqs where Item = item_);
    SET @AstrophysicsRequired    = (select Astrophysics    from Ships_Defense_Reqs where Item = item_);
    SET @HyperspaceRequired      = (select Hyperspace      from Ships_Defense_Reqs where Item = item_);
    SET @AstronavigationRequired = (select Astronavigation from Ships_Defense_Reqs where Item = item_);
    SET @LaserRequired           = (select Laser           from Ships_Defense_Reqs where Item = item_);
    SET @IonRequired             = (select Ion             from Ships_Defense_Reqs where Item = item_);
    SET @PlasmaRequired          = (select Plasma          from Ships_Defense_Reqs where Item = item_);
    SET @GravitonsRequired       = (select Gravitons       from Ships_Defense_Reqs where Item = item_);
    SET @CombatRequired          = (select Combat          from Ships_Defense_Reqs where Item = item_);
    SET @ShieldRequired          = (select Shield          from Ships_Defense_Reqs where Item = item_);
    SET @MaterialRequired        = (select Material        from Ships_Defense_Reqs where Item = item_);
    SET @IonEngineRequired       = (select IonEngine       from Ships_Defense_Reqs where Item = item_);
    SET @HyperEngineRequired     = (select HyperEngine     from Ships_Defense_Reqs where Item = item_);
    SET @ShipyardRequired        = (select Shipyard        from Ships_Defense_Reqs where Item = item_);
    SET @OrbitalShipyardRequired = (select OrbitalShipyard from Ships_Defense_Reqs where Item = item_);
    SET @NanitRequired           = (select Nanit           from Ships_Defense_Reqs where Item = item_);    
    
    RETURN IF(@Energetic       >= @EnergeticRequired       and
			  @Nanotechnology  >= @NanotechnologyRequired  and
              @Astrophysics    >= @AstrophysicsRequired    and
              @Hyperspace      >= @HyperspaceRequired      and 
              @Astronavigation >= @AstronavigationRequired and
              @Laser           >= @LaserRequired           and
              @Ion             >= @IonRequired             and
              @Plasma          >= @PlasmaRequired          and
              @Gravitons       >= @GravitonsRequired       and 
              @Combat          >= @CombatRequired          and
              @Shield          >= @ShieldRequired          and
              @Material        >= @MaterialRequired        and 
              @IonEngine       >= @IonEngineRequired       and 
              @HyperEngine     >= @HyperEngineRequired     and 
              @Shipyard        >= @ShipyardRequired        and 
              @OrbitalShipyard >= @OrbitalShipyardRequired and
              @Nanit           >= @NanitRequired,
              1, 0);
END ;;
