CREATE DEFINER=`root`@`localhost` FUNCTION `shipyardTime`(x_ smallint, y_ smallint, position_ smallint, location_ ENUM('P','M'), item_ varchar(32), number_ integer) RETURNS time
BEGIN
	SET @Cost = IF(item_ = 'RocketLauncher' or 
				   item_ = 'LaserGun' or 
                   item_ = 'TurboLaserGun' or 
                   item_ = 'IonGun' or 
                   item_ = 'TractorGun' or 
                   item_ = 'PlasmaGun' or 
                   item_ = 'HeavyPlasmaGun',
				
			   ((select Metal   from Defense_Params where Item = item_) + 
                (select Cristal from Defense_Params where Item = item_) + 
                (select Deuter  from Defense_Params where Item = item_))
                * number_, 
                
			   ((select Metal   from Ship_Params    where Item = item_) + 
                (select Cristal from Ship_Params    where Item = item_) + 
                (select Deuter  from Ship_Params    where Item = item_))
                * number_ );
                
	SET @Productivity = IF(location_ = 'P', buildingProductivity(x_, y_, position_, location_, 'Shipyard') + buildingProductivity(x_, y_, position_, location_, 'Nanit'),
											buildingProductivity(x_, y_, position_, location_, 'Shipyard') + buildingProductivity(x_, y_, position_, location_, 'OrbitalShipyard') + buildingProductivity(x_, y_, position_, location_, 'Nanit') );
	SET @SpeedRate = (select Value from Other_Consts where Id = 'SpeedRate');
    RETURN SEC_TO_TIME(3600 / @SpeedRate * @Cost / @Productivity);
END ;;
