CREATE DEFINER=`root`@`localhost` FUNCTION `solarSatEnergy`(x_ smallint, y_ smallint, position_ smallint) RETURNS float
BEGIN
	RETURN (select Radius from Star where X = x_ and Y = y_) / 
		   (select Value from Other_Consts where Id = 'StandardStarRadius') * 
           (select Value from Other_Consts where Id = 'SolarSatEnergy') / 
           ( (select Value from Other_Consts where Id = 'SolarSatTransition') + position_ );
END ;;
