CREATE DEFINER=`root`@`localhost` PROCEDURE `addNewUser`(nick varchar(32), password varchar(64))
BEGIN
	insert into User (Nick, Password) values (nick, password);
    
    SET @X = NULL;
    SET @Y = NULL;
    SET @Position = NULL;
