CREATE DEFINER=`root`@`localhost` PROCEDURE `buildUpBuilding`(x_ smallint, y_ smallint, position_ smallint, location_ ENUM('P','M'), building_ varchar(32))
BEGIN
	DECLARE EXIT HANDLER FOR SQLEXCEPTION 
    BEGIN
		ROLLBACK;
		RESIGNAL;
    END;
    
	START TRANSACTION;
    
	call updatePlanet(x_, y_, position_);
    
    SET @User = (select User from Planet where X = x_ and Y = y_ and Position = position_);
    IF buildingEnabled(x_, y_, position_, location_, building_) = '1' and 
       buildingEnoughMaterials(x_, y_, position_, location_, building_) = '1' and 
       NOT EXISTS(select * from Building_Order where X = x_ and Y = y_ and Position = position_ and Location = location_) and
       onUrlop(@User) = '0'
       THEN       
			call buildUpBuildingUnsafe(x_, y_, position_, location_, building_);       
	END IF;	   
    commit;
END ;;
