CREATE DEFINER=`root`@`localhost` PROCEDURE `newDefenseOrder`(x_ smallint, y_ smallint, position_ smallint, location_ ENUM('P','M'), item_ varchar(32), number_ integer)
BEGIN
	DECLARE EXIT HANDLER FOR SQLEXCEPTION 
    BEGIN
		ROLLBACK;
		RESIGNAL;
    END;
    
	START TRANSACTION;
    
	call updatePlanet(x_, y_, position_);
    
    SET @User = (select User from Planet where X = x_ and Y = y_ and Position = position_);
	IF shipyardEnabled(x_, y_, position_, location_, item_) and 
	   NOT EXISTS(select * from Building_Order where X = x_ and Y = y_ and Position = position_ and Location = location_ and Item = 'Shipyard')        and 
	   NOT EXISTS(select * from Building_Order where X = x_ and Y = y_ and Position = position_ and Location = location_ and Item = 'Nanit')           and 
	   NOT EXISTS(select * from Building_Order where X = x_ and Y = y_ and Position = position_ and Location = location_ and Item = 'OrbitalShipyard') and
       onUrlop(@User) = '0'
       THEN
		SET @Amount = IF(number_ > maxDefenseItems(x_, y_, position_, location_, item_),
					 maxDefenseItems(x_, y_, position_, location_, item_),
                     number_);
		SET @Metal      = (select Metal      from Planet where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_);
        SET @Metal      = @Metal   - @Amount * (select Metal   from Defense_Params where Item = item_);
		SET @Cristal    = (select Cristal    from Planet where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_);
        SET @Cristal    = @Cristal - @Amount * (select Cristal from Defense_Params where Item = item_);
		SET @Deuter     = (select Deuter     from Planet where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_);
        SET @Deuter     = @Deuter  - @Amount * (select Deuter  from Defense_Params where Item = item_);
        
        SET @StartTime  = IF(EXISTS(select * from Shipyard_Order where X = x_ and Y = y_ and Position = position_ and Location = location_),
							(select End from Shipyard_Order where X = x_ and Y = y_ and Position = position_ and Location = location_ order by End desc limit 1),
                            NOW() );
		SET @EndTime    = ADDTIME(@StartTime, defenseTime(x_, y_, position_, location_, item_, @Amount) );
		
        IF location_ = 'P' THEN
			update Planet 
				set Metal = @Metal
					where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_;
			update Planet 
				set Cristal = @Cristal
					where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_;
			update Planet 
				set Deuter = @Deuter
					where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_;
			insert into Shipyard_Order (X, Y, Position, Location, Item, Amount, Start, End) 
								values (x_, y_, position_, location_, item_, @Amount, @StartTime, @EndTime );
		ELSE 
			update Moon 
				set Metal = @Metal
					where Moon.X = x_ and Moon.Y = y_ and Moon.Position = position_;
			update Moon 
				set Cristal = @Cristal
					where Moon.X = x_ and Moon.Y = y_ and Moon.Position = position_;
			update Moon 
				set Deuter = @Deuter
					where Moon.X = x_ and Moon.Y = y_ and Moon.Position = position_;
			insert into Shipyard_Order (X, Y, Position, Location, Item, Amount, Start, End) 
								values (x_, y_, position_, location_, item_, @Amount, @StartTime, @EndTime );
		END IF;
    
    END IF;
    commit;
END ;;
