BEGIN
	DECLARE EXIT HANDLER FOR SQLEXCEPTION 
    BEGIN
		ROLLBACK;
		RESIGNAL;
    END;
    
	START TRANSACTION;
    
	call updatePlanet(x_, y_, position_);
    
    SET @User = (select User from Planet where X = x_ and Y = y_ and Position = position_);
    IF researchEnabled(x_, y_, position_, research_) = '1' and 
       researchEnoughMaterials(x_, y_, position_, research_) = '1' and 
       NOT EXISTS(select * from Research_Order where X = x_ and Y = y_ and Position = position_) and
       NOT EXISTS(select * from Building_Order where X = x_ and Y = y_ and Position = position_ and Item = 'Laboratory') and
       onUrlop(@User) = '0'
       THEN       
			call researchUpUnsafe(x_, y_, position_, research_);       
	END IF;	   
    commit;
END ;;
