    SET @User = (select User from Planet where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_);
    
    update Planet 
		set Metal = @Metal - researchCost(x_, y_, position_, 'M', research_) 
			where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_;
	update Planet 
		set Cristal = @Cristal - researchCost(x_, y_, position_, 'K', research_) 
			where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_;
	update Planet 
		set Deuter = @Deuter - researchCost(x_, y_, position_, 'D', research_) 
			where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_;
	update Planet 
		set Antimatter = @Antimatter - researchCost(x_, y_, position_, 'A', research_) 
			where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_;
    insert into Research_Order (X, Y, Position, Item, Amount, Start, End) 
	    (select X,
				Y,
                Position, 
				research_ as Item, 
                researchLvl(x_, y_, position_, research_) + 1 as Amount, 
                @StartTime as Start, 
                ADDTIME(@StartTime, researchTime(x_, y_, position_, research_) ) as End 
			from Planet
			where Planet.User = @User and
            planetDistance(x_, y_, position_, Planet.X, Planet.Y, Planet.Position) <= buildingProductivity(x_, y_, position_, 'P', 'ResearchNet') and
			NOT EXISTS(select * 
							from Research_Order 
                            where Research_Order.X = Planet.X and 
									Research_Order.Y = Planet.Y and 
                                    Research_Order.Position = Planet.Position
					  ) 
		);
	commit;
END ;;
DELIMITER ;
