CREATE DEFINER=`root`@`localhost` PROCEDURE `sendBackSameFlight`(id_ integer, metal_ integer, cristal_ integer, deuter_ integer, antimatter_ integer)
BEGIN
	DECLARE EXIT HANDLER FOR SQLEXCEPTION 
    BEGIN
		ROLLBACK;
		RESIGNAL;
    END;
    
	START TRANSACTION;
    
	SET @EndTime    = (select EndTime   from Flight where Id = id_ );
    SET @StartTime  = (select StartTime from Flight where Id = id_ );
    SET @FlightTime = TIMEDIFF(@EndTime, @StartTime);
    SET @FlightEndTime = ADDTIME(@EndTime, @FlightTime);
	
    SET @FormerMission = (select Mission from Flight where Id = id_ );
    
    SET @StartX        = (select StartX        from Flight where Id = id_ );
    SET @StartY        = (select StartY        from Flight where Id = id_ );
    SET @StartPosition = (select StartPosition from Flight where Id = id_ );
    SET @StartLocation = (select StartLocation from Flight where Id = id_ );
    SET @EndX          = (select EndX          from Flight where Id = id_ );
    SET @EndY          = (select EndY          from Flight where Id = id_ );
    SET @EndPosition   = (select EndPosition   from Flight where Id = id_ );
    SET @EndLocation   = (select EndLocation   from Flight where Id = id_ );
               
    insert into Flight (StartX, StartY, StartPosition, StartLocation, StartTime, Mission, FormerMission, EndX, EndY, EndPosition, EndLocation, EndTime, Transporter, Freighter, Recycler, Colonizer, SpySond, Fighter, IonFighter, Frigate, Bomber, Cruiser, Drednot, Destroyer, DeathStar, Metal, Cristal, Deuter, Antimatter, TurnedBack)
			select @EndX, @EndY, @EndPosition, @EndLocation, @EndTime, 'S', @FormerMission, @StartX, @StartY, @StartPosition, @StartLocation, @FlightEndTime, Transporter, Freighter, Recycler, Colonizer, SpySond, Fighter, IonFighter, Frigate, Bomber, Cruiser, Drednot, Destroyer, DeathStar, metal_, cristal_, deuter_, antimatter_, 'YES'
			from Flight where Id = id_;
	commit;
END ;;
