CREATE DEFINER=`root`@`localhost` PROCEDURE `sendFlight`(
							  x1_ smallint,
							  y1_ smallint, 
                              position1_ smallint,
                              location1_ ENUM('P','M'),
                              mission_ ENUM('T','S','K','SZ','R','A','N'),
                              x2_ smallint,
                              y2_ smallint,
                              position2_ smallint,
                              location2_ ENUM('P','M','D'),
                              transporter_ integer,
                              freighter_ integer,
                              recycler_ integer,
                              colonizer_ integer,
                              spySond_ integer,
                              fighter_ integer,
                              ionFighter_ integer,
                              frigate_ integer,
                              bomber_ integer,
                              cruiser_ integer,
                              drednot_ integer,
                              destroyer_ integer,
                              deathStar_ integer,
                              speed_ float,
                              metal_ float,
                              cristal_ float,
                              deuter_ float,
                              antimatter_ float)
BEGIN
	DECLARE EXIT HANDLER FOR SQLEXCEPTION 
    BEGIN
		ROLLBACK;
		RESIGNAL;
    END;
    
	START TRANSACTION;
    
	call updatePlanet(x1_, y1_, position1_);
    call updatePlanet(x2_, y2_, position2_);
	
    SET @User1 = (select User from Planet where X = x1_ and Y = y1_ and Position = position1_);
    SET @User2 = (select User from Planet where X = x2_ and Y = y2_ and Position = position2_);
	IF sendFlightPossible(x1_ , y1_ , position1_ , location1_ ,
                          mission_ ,
                          x2_ , y2_ , position2_ , location2_ ,
                          transporter_ , freighter_ , recycler_ , colonizer_ , spySond_ , fighter_ , ionFighter_ , frigate_ , bomber_ , cruiser_ , drednot_ , destroyer_ , deathStar_ ,
                          speed_ , metal_ , cristal_ , deuter_ , antimatter_ ) = '1' and
                          onUrlop(@User1) = '0' and onUrlop(@User2) = '0'
	THEN
		SET @FlightTime = flightTime(x1_ , y1_ , position1_ ,
                              x2_ , y2_ , position2_ ,
                              transporter_ , freighter_ , recycler_ , colonizer_ , spySond_ , fighter_ , ionFighter_ , frigate_ , bomber_ , cruiser_ , drednot_ , destroyer_ , deathStar_ ,
                              speed_ );
		SET @FlightFuel = IF(mission_ = 'S',
					flightFuel(
							  x1_ , y1_ , position1_ , 
                              x2_ , y2_ , position2_ , 
                              transporter_ , freighter_ , recycler_ , colonizer_ , spySond_ , fighter_ , ionFighter_ , frigate_ , bomber_ , cruiser_ , drednot_ , destroyer_ , deathStar_ ,
                              speed_ ),
					2 * flightFuel(
							  x1_ , y1_ , position1_ , 
                              x2_ , y2_ , position2_ , 
                              transporter_ , freighter_ , recycler_ , colonizer_ , spySond_ , fighter_ , ionFighter_ , frigate_ , bomber_ , cruiser_ , drednot_ , destroyer_ , deathStar_ ,
                              speed_ ) );
                              
		IF location1_ = 'P' THEN
            update Planet set Transporter = Transporter - transporter_ where X = x1_ and Y = y1_ and Position = position1_;
            update Planet set Freighter   = Freighter   - freighter_   where X = x1_ and Y = y1_ and Position = position1_;
            update Planet set Recycler    = Recycler    - recycler_    where X = x1_ and Y = y1_ and Position = position1_;
            update Planet set Colonizer   = Colonizer   - colonizer_   where X = x1_ and Y = y1_ and Position = position1_;
            update Planet set SpySond     = SpySond     - spySond_     where X = x1_ and Y = y1_ and Position = position1_;
            update Planet set Fighter     = Fighter     - fighter_     where X = x1_ and Y = y1_ and Position = position1_;
            update Planet set IonFighter  = IonFighter  - ionFighter_  where X = x1_ and Y = y1_ and Position = position1_;
            update Planet set Frigate     = Frigate     - frigate_     where X = x1_ and Y = y1_ and Position = position1_;
            update Planet set Bomber      = Bomber      - bomber_      where X = x1_ and Y = y1_ and Position = position1_;
            update Planet set Cruiser     = Cruiser     - cruiser_     where X = x1_ and Y = y1_ and Position = position1_;
            update Planet set Drednot     = Drednot     - drednot_     where X = x1_ and Y = y1_ and Position = position1_;
            update Planet set Destroyer   = Destroyer   - destroyer_   where X = x1_ and Y = y1_ and Position = position1_;
            update Planet set DeathStar   = DeathStar   - deathStar_   where X = x1_ and Y = y1_ and Position = position1_;
            update Planet set Metal       = Metal       - metal_       where X = x1_ and Y = y1_ and Position = position1_;
            update Planet set Cristal     = Cristal     - cristal_     where X = x1_ and Y = y1_ and Position = position1_;
            update Planet set Deuter      = Deuter - deuter_ - @FlightFuel where X = x1_ and Y = y1_ and Position = position1_;
            update Planet set Antimatter  = Antimatter  - antimatter_  where X = x1_ and Y = y1_ and Position = position1_;
            
		ELSE
            update Moon set Transporter = Transporter - transporter_ where X = x1_ and Y = y1_ and Position = position1_;
            update Moon set Freighter   = Freighter   - freighter_   where X = x1_ and Y = y1_ and Position = position1_;
            update Moon set Recycler    = Recycler    - recycler_    where X = x1_ and Y = y1_ and Position = position1_;
            update Moon set Colonizer   = Colonizer   - colonizer_   where X = x1_ and Y = y1_ and Position = position1_;
            update Moon set SpySond     = SpySond     - spySond_     where X = x1_ and Y = y1_ and Position = position1_;
            update Moon set Fighter     = Fighter     - fighter_     where X = x1_ and Y = y1_ and Position = position1_;
            update Moon set IonFighter  = IonFighter  - ionFighter_  where X = x1_ and Y = y1_ and Position = position1_;
            update Moon set Frigate     = Frigate     - frigate_     where X = x1_ and Y = y1_ and Position = position1_;
            update Moon set Bomber      = Bomber      - bomber_      where X = x1_ and Y = y1_ and Position = position1_;
            update Moon set Cruiser     = Cruiser     - cruiser_     where X = x1_ and Y = y1_ and Position = position1_;
            update Moon set Drednot     = Drednot     - drednot_     where X = x1_ and Y = y1_ and Position = position1_;
            update Moon set Destroyer   = Destroyer   - destroyer_   where X = x1_ and Y = y1_ and Position = position1_;
            update Moon set DeathStar   = DeathStar   - deathStar_   where X = x1_ and Y = y1_ and Position = position1_;
            update Moon set Metal       = Metal       - metal_       where X = x1_ and Y = y1_ and Position = position1_;
            update Moon set Cristal     = Cristal     - cristal_     where X = x1_ and Y = y1_ and Position = position1_;
            update Moon set Deuter      = Deuter - @FlightFuel - deuter_ where X = x1_ and Y = y1_ and Position = position1_;
            update Moon set Antimatter  = Antimatter  - antimatter_  where X = x1_ and Y = y1_ and Position = position1_;
	END IF;    
    
	insert into Flight (StartX, StartY, StartPosition, StartLocation, StartTime, Mission, EndX, EndY, EndPosition, EndLocation, EndTime, Transporter, Freighter, Recycler, Colonizer, SpySond, Fighter, IonFighter, Frigate, Bomber, Cruiser, Drednot, Destroyer, DeathStar, Metal, Cristal, Deuter, Antimatter) values
                       (x1_, y1_, position1_, location1_, NOW(), mission_, x2_, y2_, position2_, location2_, ADDTIME(NOW(), @FlightTime), transporter_, freighter_, recycler_, colonizer_, spySond_, fighter_, ionFighter_, frigate_, bomber_, cruiser_, drednot_, destroyer_, deathStar_, metal_, cristal_, deuter_, antimatter_);
           
	END IF;
    commit;
END ;;
