CREATE DEFINER=`root`@`localhost` PROCEDURE `updateBuildingOrders`(x_ smallint, y_ smallint, position_ smallint, location_ ENUM('P','M') )
BEGIN
	DECLARE EXIT HANDLER FOR SQLEXCEPTION 
    BEGIN
		ROLLBACK;
		RESIGNAL;
    END;
    
	START TRANSACTION;
    
	IF EXISTS(select * from Building_Order where Building_Order.X = x_ and Building_Order.Y = y_ and Building_Order.Position = position_ and Building_Order.Location = location_ and NOW() >= Building_Order.End) THEN
		SET @Building = (select Item   from Building_Order where X = x_ and Y = y_ and Position = position_ and Location_ = location_ limit 1);
        SET @Lvl      = (select Amount from Building_Order where X = x_ and Y = y_ and Position = position_ and Location_ = location_ limit 1);
        
        delete from Building_Order where Building_Order.X = x_ and Building_Order.Y = y_ and Building_Order.Position = position_ and Building_Order.Location = location_ and NOW() >= Building_Order.End;
        
		IF location_ = 'P' THEN    
			SET @Points = (buildingCost(x_, y_, position_, 'P', 'M', @Building) + 
						   buildingCost(x_, y_, position_, 'P', 'K', @Building) + 
                           buildingCost(x_, y_, position_, 'P', 'D', @Building) + 
                           buildingCost(x_, y_, position_, 'P', 'A', @Building) ) / 1000;
			update Planet set EconomyPoints = EconomyPoints + @Points where X = x_ and Y = y_ and Position = position_ ;
        
			IF @Building = 'MetalMine'     THEN update Planet set MetalMine     = @Lvl where X = x_ and Y = y_ and Position = position_; END IF;
			IF @Building = 'CristalMine'   THEN update Planet set CristalMine   = @Lvl where X = x_ and Y = y_ and Position = position_; END IF;
			IF @Building = 'DeuterExt'     THEN update Planet set DeuterExt     = @Lvl where X = x_ and Y = y_ and Position = position_; END IF;
			IF @Building = 'Fusion'        THEN update Planet set Fusion        = @Lvl where X = x_ and Y = y_ and Position = position_; END IF;
			IF @Building = 'Accelerator'   THEN update Planet set Accelerator   = @Lvl where X = x_ and Y = y_ and Position = position_; END IF;
			IF @Building = 'MetalMag'      THEN update Planet set MetalMag      = @Lvl where X = x_ and Y = y_ and Position = position_; END IF;
			IF @Building = 'CristalMag'    THEN update Planet set CristalMag    = @Lvl where X = x_ and Y = y_ and Position = position_; END IF;
			IF @Building = 'DeuterMag'     THEN update Planet set DeuterMag     = @Lvl where X = x_ and Y = y_ and Position = position_; END IF;
			IF @Building = 'AntimatterMag' THEN update Planet set AntimatterMag = @Lvl where X = x_ and Y = y_ and Position = position_; END IF;
			IF @Building = 'Robot'         THEN update Planet set Robot         = @Lvl where X = x_ and Y = y_ and Position = position_; END IF;
			IF @Building = 'Nanit'         THEN update Planet set Nanit         = @Lvl where X = x_ and Y = y_ and Position = position_; END IF;
			IF @Building = 'Shipyard'      THEN update Planet set Shipyard      = @Lvl where X = x_ and Y = y_ and Position = position_; END IF;
			IF @Building = 'Laboratory'    THEN update Planet set Laboratory    = @Lvl where X = x_ and Y = y_ and Position = position_; END IF;
			IF @Building = 'Observatory'   THEN update Planet set Observatory   = @Lvl where X = x_ and Y = y_ and Position = position_; END IF;
			IF @Building = 'ResearchNet'   THEN update Planet set ResearchNet   = @Lvl where X = x_ and Y = y_ and Position = position_; END IF;
			IF @Building = 'RayShield'     THEN update Planet set RayShield     = @Lvl where X = x_ and Y = y_ and Position = position_;  END IF;
		ELSE 
			SET @Points = (buildingCost(x_, y_, position_, 'M', 'M', @Building) + 
						   buildingCost(x_, y_, position_, 'M', 'K', @Building) + 
                           buildingCost(x_, y_, position_, 'M', 'D', @Building) + 
                           buildingCost(x_, y_, position_, 'M', 'A', @Building) ) / 1000;
			update Moon set EconomyPoints = EconomyPoints + @Points where X = x_ and Y = y_ and Position = position_ ;
        
			IF @Building = 'MoonObservatory' THEN update Moon set MoonObservatory = @Lvl where X = x_ and Y = y_ and Position = position_; END IF;
            IF @Building = 'OrbitalShipyard' THEN update Moon set OrbitalShipyard = @Lvl where X = x_ and Y = y_ and Position = position_; END IF;
            IF @Building = 'Teleporter'      THEN update Moon set Teleporter      = @Lvl where X = x_ and Y = y_ and Position = position_; END IF;
            IF @Building = 'Robot'           THEN update Moon set Robot           = @Lvl where X = x_ and Y = y_ and Position = position_; END IF;
            IF @Building = 'Nanit'           THEN update Moon set Nanit           = @Lvl where X = x_ and Y = y_ and Position = position_; END IF;
            IF @Building = 'Shipyard'        THEN update Moon set Shipyard        = @Lvl where X = x_ and Y = y_ and Position = position_; END IF;
            IF @Building = 'MetalMag'        THEN update Moon set MetalMag        = @Lvl where X = x_ and Y = y_ and Position = position_; END IF;
            IF @Building = 'CristalMag'      THEN update Moon set CristalMag      = @Lvl where X = x_ and Y = y_ and Position = position_; END IF;
            IF @Building = 'DeuterMag'       THEN update Moon set DeuterMag       = @Lvl where X = x_ and Y = y_ and Position = position_; END IF;
            IF @Building = 'AntimatterMag'   THEN update Moon set AntimatterMag   = @Lvl where X = x_ and Y = y_ and Position = position_; END IF;
		END IF;
    END IF;
    commit;
END ;;
DELIMITER ;
