CREATE DEFINER=`root`@`localhost` PROCEDURE `updateDebris`(id_ integer)
BEGIN
	DECLARE EXIT HANDLER FOR SQLEXCEPTION 
    BEGIN
		ROLLBACK;
		RESIGNAL;
    END;
    
	START TRANSACTION;
    
	SET @EndX        = (select EndX        from Flight where Id = id_ );
    SET @EndY        = (select EndY        from Flight where Id = id_ );
    SET @EndPosition = (select EndPosition from Flight where Id = id_ );

	SET @Recyclers     = (select Recycler from Flight where Id = id_ );
    SET @Capacity      = @Recyclers * (select Capacity from Ship_Params where Item = 'Recycler');
    SET @MetalDebris   = (select MetalDebris   from Planet where X = @EndX and Y = @EndY and Position = @EndPosition );
    SET @CristalDebris = (select CristalDebris from Planet where X = @EndX and Y = @EndY and Position = @EndPosition );
               
    SET @FoundMetal = IF(@MetalDebris + @CristalDebris <= @Capacity, 
						 @MetalDebris,
                         @MetalDebris * @Capacity / (@MetalDebris + @CristalDebris) );
	SET @FoundCristal = IF(@MetalDebris + @CristalDebris <= @Capacity, 
						 @CristalDebris,
                         @CristalDebris * @Capacity / (@MetalDebris + @CristalDebris) );
                
    update Planet set MetalDebris      = @MetalDebris   - @FoundMetal   where X = @EndX and Y = @EndY and Position = @EndPosition;
    update Planet set CristalDebris    = @CristalDebris - @FoundCristal where X = @EndX and Y = @EndY and Position = @EndPosition;
    
    call sendBackSameFlight(@Id_, @TransportedMetal + @FoundMetal, @TransportedCristal + @FoundCristal, @TransportedDeuter, @TransportedAntimatter);
    commit;
END ;;
