CREATE DEFINER=`root`@`localhost` PROCEDURE `updateFlightMaterials`(id_ integer)
BEGIN
	DECLARE EXIT HANDLER FOR SQLEXCEPTION 
    BEGIN
		ROLLBACK;
		RESIGNAL;
    END;
    
	START TRANSACTION;
    
	SET @X_        = (select EndX        from Flight where Id = id_ );
    SET @Y_        = (select EndY        from Flight where Id = id_ );
    SET @Position_ = (select EndPosition from Flight where Id = id_ );
	SET @Location_ = (select EndLocation from Flight where Id = id_ );
    
    SET @TransportedMetal      = (select Metal      from Flight where Id = id_ );
	SET @TransportedCristal    = (select Cristal    from Flight where Id = id_ );
	SET @TransportedDeuter     = (select Deuter     from Flight where Id = id_ );
	SET @TransportedAntimatter = (select Antimatter from Flight where Id = id_ );
    
	IF  @Location_  = 'P' THEN
		SET @Metal      = (select Metal      from Planet where X = @X_ and Y = @Y_ and Position = @Position_);
		SET @Cristal    = (select Cristal    from Planet where X = @X_ and Y = @Y_ and Position = @Position_);
		SET @Deuter     = (select Deuter     from Planet where X = @X_ and Y = @Y_ and Position = @Position_);
		SET @Antimatter = (select Antimatter from Planet where X = @X_ and Y = @Y_ and Position = @Position_);
                
        SET @NewMetal   = IF(@Metal + @TransportedMetal <= buildingProductivity(@X_, @Y_, @Position_, @Location_, 'MetalMag'),
						@Metal + @TransportedMetal,
						buildingProductivity(@X_, @Y_, @Position_, @Location_, 'MetalMag') );
		SET @NewCristal = IF(@Cristal + @TransportedCristal <= buildingProductivity(@X_, @Y_, @Position_, @Location_, 'CristalMag'),
						@Cristal + @TransportedCristal,
						buildingProductivity(@X_, @Y_, @Position_, @Location_, 'CristalMag') );
		SET @NewDeuter  = IF(@Deuter + @TransportedDeuter <= buildingProductivity(@X_, @Y_, @Position_, @Location_, 'DeuterMag'),
						@Deuter + @TransportedDeuter,
						buildingProductivity(@X_, @Y_, @Position_, @Location_, 'DeuterMag') );
		SET @NewAntimatter = IF(@Antimatter + @TransportedAntimatter <= buildingProductivity(@X_, @Y_, @Position_, @Location_, 'AntimatterMag'),
						@Antimatter + @TransportedAntimatter,
						buildingProductivity(@X_, @Y_, @Position_, @Location_, 'AntimatterMag') );        
                
		update Planet set Metal      = @NewMetal      where X = @X_ and Y = @Y_ and Position = @Position_;
		update Planet set Cristal    = @NewCristal    where X = @X_ and Y = @Y_ and Position = @Position_;
		update Planet set Deuter     = @NewDeuter     where X = @X_ and Y = @Y_ and Position = @Position_;
		update Planet set Antimatter = @NewAntimatter where X = @X_ and Y = @Y_ and Position = @Position_;
        
	END IF; 
    
    IF  @Location_ = 'M' THEN
		SET @Metal      = (select Metal      from Moon where X = @X_ and Y = @Y_ and Position = @Position_);
		SET @Cristal    = (select Cristal    from Moon where X = @X_ and Y = @Y_ and Position = @Position_);
		SET @Deuter     = (select Deuter     from Moon where X = @X_ and Y = @Y_ and Position = @Position_);
		SET @Antimatter = (select Antimatter from Moon where X = @X_ and Y = @Y_ and Position = @Position_);
           
		SET @NewMetal   = IF(@Metal + @TransportedMetal <= buildingProductivity(@X_, @Y_, @Position_, @Location_, 'MetalMag'),
						@Metal + @TransportedMetal,
						buildingProductivity(@X_, @Y_, @Position_, @Location_, 'MetalMag') );
		SET @NewCristal = IF(@Cristal + @TransportedCristal <= buildingProductivity(@X_, @Y_, @Position_, @Location_, 'CristalMag'),
						@Cristal + @TransportedCristal,
						buildingProductivity(@X_, @Y_, @Position_, @Location_, 'CristalMag') );
		SET @NewDeuter  = IF(@Deuter + @TransportedDeuter <= buildingProductivity(@X_, @Y_, @Position_, @Location_, 'DeuterMag'),
						@Deuter + @TransportedDeuter,
						buildingProductivity(@X_, @Y_, @Position_, @Location_, 'DeuterMag') );
		SET @NewAntimatter = IF(@Antimatter + @TransportedAntimatter <= buildingProductivity(@X_, @Y_, @Position_, @Location_, 'AntimatterMag'),
						@Antimatter + @TransportedAntimatter,
						buildingProductivity(@X_, @Y_, @Position_, @Location_, 'AntimatterMag') );
           
		update Moon set Metal      = @NewMetal      where X = @X_ and Y = @Y_ and Position = @Position_;
		update Moon set Cristal    = @NewCristal    where X = @X_ and Y = @Y_ and Position = @Position_;
		update Moon set Deuter     = @NewDeuter     where X = @X_ and Y = @Y_ and Position = @Position_;
		update Moon set Antimatter = @NewAntimatter where X = @X_ and Y = @Y_ and Position = @Position_;
    END IF; 
    
    IF @Location_ = 'D' THEN
		SET @Metal      = (select MetalDebris   from Planet where X = @X_ and Y = @Y_ and Position = @Position_);
		SET @Cristal    = (select CristalDebris from Planet where X = @X_ and Y = @Y_ and Position = @Position_);
        
        update Planet set MetalDebris      = @Metal   + @TransportedMetal   where X = @X_ and Y = @Y_ and Position = @Position_;
        update Planet set CristalDebris    = @Cristal + @TransportedCristal where X = @X_ and Y = @Y_ and Position = @Position_;
                
    END IF; 
    commit;
END ;;
DELIMITER ;
