CREATE DEFINER=`root`@`localhost` PROCEDURE `updateFlights`(x_ smallint, y_ smallint, position_ smallint, location_ ENUM('P','M','D') )
BEGIN
	DECLARE EXIT HANDLER FOR SQLEXCEPTION 
    BEGIN
		ROLLBACK;
		RESIGNAL;
    END;
    
	START TRANSACTION;
    
	WHILE EXISTS(select * from Flight where (StartX = x_ and StartY = y_ and StartPosition = position_ and StartLocation = location_ and NOW() >= EndTime) or (EndX = x_ and EndY = y_ and EndPosition = position_ and EndLocation = location_ and NOW() >= EndTime) ) DO
		SET @Id_     = (select Id      from Flight where (StartX = x_ and StartY = y_ and StartPosition = position_ and StartLocation = location_ and NOW() >= EndTime) or (EndX = x_ and EndY = y_ and EndPosition = position_ and EndLocation = location_ and NOW() >= EndTime) order by EndTime desc limit 1);
        SET @Mission = (select Mission from Flight where Id = @Id_ );
        
        SET @TransportedMetal      = (select Metal      from Flight where Id = @Id_ );
		SET @TransportedCristal    = (select Cristal    from Flight where Id = @Id_ );
		SET @TransportedDeuter     = (select Deuter     from Flight where Id = @Id_ );
		SET @TransportedAntimatter = (select Antimatter from Flight where Id = @Id_ );
        
        SET @StartX        = (select StartX        from Flight where Id = @Id_ );
        SET @StartY        = (select StartY        from Flight where Id = @Id_ );
        SET @StartPosition = (select StartPosition from Flight where Id = @Id_ );
        SET @StartLocation = (select StartLocation from Flight where Id = @Id_ );
            
        SET @EndX        = (select EndX        from Flight where Id = @Id_ );
        SET @EndY        = (select EndY        from Flight where Id = @Id_ );
        SET @EndPosition = (select EndPosition from Flight where Id = @Id_ );
        SET @EndLocation = (select EndLocation from Flight where Id = @Id_ );
              
        SET @StartUser = (select User from Planet where X = @StartX and Y = @StartY and Position = @StartPosition);
		SET @EndUser   = (select User from Planet where X = @EndX and Y = @EndY and Position = @EndPosition);
        
        IF location_ = 'P' THEN         
			IF @Mission = 'T' THEN 
				SET @Metal      = (select Metal      from Planet where X = @EndX and Y = @EndY and Position = @EndPosition);
				SET @Cristal    = (select Cristal    from Planet where X = @EndX and Y = @EndY and Position = @EndPosition);
				SET @Deuter     = (select Deuter     from Planet where X = @EndX and Y = @EndY and Position = @EndPosition);
				SET @Antimatter = (select Antimatter from Planet where X = @EndX and Y = @EndY and Position = @EndPosition);
                
                SET @RestMetal   = IF(@Metal + @TransportedMetal <= buildingProductivity(@EndX, @EndY, @EndPosition, 'P', 'MetalMag'),
								   0,
                                   @Metal + @TransportedMetal - buildingProductivity(@EndX, @EndY, @EndPosition, 'P', 'MetalMag') );
				SET @RestCristal = IF(@Cristal + @TransportedCristal <= buildingProductivity(@EndX, @EndY, @EndPosition, 'P', 'CristalMag'),
								   0,
                                   @Cristal + @TransportedCristal - buildingProductivity(@EndX, @EndY, @EndPosition, 'P', 'CristalMag') );
				SET @RestDeuter  = IF(@Deuter + @TransportedDeuter <= buildingProductivity(@EndX, @EndY, @EndPosition, 'P', 'DeuterMag'),
								   0,
                                   @Deuter + @TransportedDeuter - buildingProductivity(@EndX, @EndY, @EndPosition, 'P', 'DeuterMag') );
				SET @RestAntimatter = IF(@Antimatter + @TransportedAntimatter <= buildingProductivity(@EndX, @EndY, @EndPosition, 'P', 'AntimatterMag'),
								   0,
                                   @Antimatter + @TransportedAntimatter - buildingProductivity(@EndX, @EndY, @EndPosition, 'P', 'AntimatterMag') );
                
                call updateFlightMaterials(@Id_ );
                call sendBackSameFlight(@Id_, @RestMetal, @RestCristal, @RestDeuter, @RestAntimatter);
                call flightReport(@StartX, @StartY, @StartPosition, @StartLocation, @EndX, @EndY, @EndPosition, @EndLocation, 'T', '1');
			END IF; 
				
			IF @Mission = 'S' THEN 
				call updateFlightMaterials(@Id_ );
                call updateFlightShips(@Id_ );      
                call flightReport(@StartX, @StartY, @StartPosition, @StartLocation, @EndX, @EndY, @EndPosition, @EndLocation, 'S', '1');
			END IF; 
        
			IF @Mission = 'K' THEN          
                IF IS_NULL(@EndUser) THEN 
				    call colonizePlanet(@StartUser, @EndX, @EndY, @EndPosition);
                    call updateFlightMaterials(@Id_ );
					call updateFlightShips(@Id_ );
                    call flightReport(@StartX, @StartY, @StartPosition, @StartLocation, @EndX, @EndY, @EndPosition, @EndtLocation, 'K', '1');
                    
				ELSE 
					call sendBackSameFlight(@Id_, @TransportedMetal, @TransportedCristal, @TransportedDeuter, @TransportedAntimatter);
                    call flightReport(@StartX, @StartY, @StartPosition, @StartLocation, @EndX, @EndY, @EndPosition, @EndLocation, 'K', '0');
                END IF;
			END IF; 
            
            IF @Mission = 'R' THEN 
				call updateDebrisAndSendBack(@Id_ );
                call flightReport(@StartX, @StartY, @StartPosition, @StartLocation, @EndX, @EndY, @EndPosition, @EndLocation, 'R', '1');
            END IF; 
        
			IF @Mission = 'SZ' THEN 
				call sendBackSameFlight(@Id_, @TansportedMetal, @TransportedCristal, @TransportedDeuter, @TransportedAntimatter);
				call flightReport(@StartX, @StartY, @StartPosition, @StartLocation, @EndX, @EndY, @EndPosition, @EndLocation, 'SZ', '1');
			END IF; 
        
			IF @Mission = 'A' THEN 
				call sendBackSameFlight(@Id_, @TansportedMetal, @TransportedCristal, @TransportedDeuter, @TransportedAntimatter);
                call flightReport(@StartX, @StartY, @StartPosition, @StartLocation, @EndX, @EndY, @EndPosition, @EndLocation, 'A', '1');
			END IF; 
					
			IF @Mission = 'N' THEN 
				call sendBackSameFlight(@Id_, @TansportedMetal, @TransportedCristal, @TransportedDeuter, @TransportedAntimatter);
                call destroyReport(@EndX, @EndY, @EndPosition, @EndLocation, @StartUser, @EndUser);
                call deletePlanet(@EndX, @EndY, @EndPosition);
                call flightReport(@StartX, @StartY, @StartPosition, @StartLocation, @EndX, @EndY, @EndPosition, @EndLocation, 'D', '1');
            END IF;          
        END IF; 
        
        IF location_ = 'M' THEN 
			IF @Mission = 'T' THEN 
				SET @Metal      = (select Metal      from Moon where X = @EndX and Y = @EndY and Position = @EndPosition);
				SET @Cristal    = (select Cristal    from Moon where X = @EndX and Y = @EndY and Position = @EndPosition);
				SET @Deuter     = (select Deuter     from Moon where X = @EndX and Y = @EndY and Position = @EndPosition);
				SET @Antimatter = (select Antimatter from Moon where X = @EndX and Y = @EndY and Position = @EndPosition);

                SET @RestMetal   = IF(@Metal + @TransportedMetal <= buildingProductivity(@EndX, @EndY, @EndPosition, 'M', 'MetalMag'),
								   0,
                                   @Metal + @TransportedMetal - buildingProductivity(@EndX, @EndY, @EndPosition, 'M', 'MetalMag') );
				SET @RestCristal = IF(@Cristal + @TransportedCristal <= buildingProductivity(@EndX, @EndY, @EndPosition, 'M', 'CristalMag'),
								   0,
                                   @Cristal + @TransportedCristal - buildingProductivity(@EndX, @EndY, @EndPosition, 'M', 'CristalMag') );
				SET @RestDeuter  = IF(@Deuter + @TransportedDeuter <= buildingProductivity(@EndX, @EndY, @EndPosition, 'M', 'DeuterMag'),
								   0,
                                   @Deuter + @TransportedDeuter - buildingProductivity(@EndX, @EndY, @EndPosition, 'M', 'DeuterMag') );
				SET @RestAntimatter = IF(@Antimatter + @TransportedAntimatter <= buildingProductivity(@EndX, @EndY, @EndPosition, 'M', 'AntimatterMag'),
								   0,
                                   @Antimatter + @TransportedAntimatter - buildingProductivity(@EndX, @EndY, @EndPosition, 'M', 'AntimatterMag') );
                
                call updateFlightMaterials(@Id_ );
                call sendBackSameFlight(@Id_, @RestMetal, @RestCristal, @RestDeuter, @RestAntimatter);
			END IF; 
        
			IF @Mission = 'S' THEN 
				call updateFlightMaterials(@Id_ );
                call updateFlightShips(@Id_ );
                call flightReport(@StartX, @StartY, @StartPosition, @StartLocation, @EndX, @EndY, @EndPosition, @EndLocation, 'S', '1');
			END IF; 
            
            IF @Mission = 'K' THEN          
                IF IS_NULL(@EndUser) THEN 
				    call colonizePlanet(@StartUser, @EndX, @EndY, @EndPosition);
                    call updateFlightMaterials(@Id_ );
					call updateFlightShips(@Id_ );
                    call flightReport(@StartX, @StartY, @StartPosition, @StartLocation, @EndX, @EndY, @EndPosition, @EndLocation, 'T', '1');
                    
				ELSE 
					call sendBackSameFlight(@Id_, @TransportedMetal, @TransportedCristal, @TransportedDeuter, @TransportedAntimatter);
                END IF;
			END IF; 
            
            IF @Mission = 'R' THEN 
				call updateDebrisAndSendBack(@Id_ );
                call flightReport(@StartX, @StartY, @StartPosition, @StartLocation, @EndX, @EndY, @EndPosition, @EndLocation, 'R', '1');
            END IF; 
        
			IF @Mission = 'SZ' THEN 
				call sendBackSameFlight(@Id_, @TansportedMetal, @TransportedCristal, @TransportedDeuter, @TransportedAntimatter);
				call spyReport(@EndX, @EndY, @EndPosition, @EndLocation, @StartUser, @EndUser);
                call flightReport(@StartX, @StartY, @StartPosition, @StartLocation, @EndX, @EndY, @EndPosition, @EndLocation, 'SZ', '1');
			END IF; 
        
			IF @Mission = 'A' THEN 
				call sendBackSameFlight(@Id_, @TansportedMetal, @TransportedCristal, @TransportedDeuter, @TransportedAntimatter);
                call warReport(@EndX, @EndY, @EndPosition, @EndLocation, @StartUser, @EndUser);
                call flightReport(@StartX, @StartY, @StartPosition, @StartLocation, @EndX, @EndY, @EndPosition, @EndLocation, 'A', '1');
			END IF; 
        
			IF @Mission = 'N' THEN 
				call sendBackSameFlight(@Id_, @TansportedMetal, @TransportedCristal, @TransportedDeuter, @TransportedAntimatter);
                call destroyReport(@EndX, @EndY, @EndPosition, @EndLocation, @StartUser, @EndUser);
                call deleteMoon(@EndX, @EndY, @EndPosition);
                call flightReport(@StartX, @StartY, @StartPosition, @StartLocation, @EndX, @EndY, @EndPosition, @EndLocation, 'N', '1');
			END IF; 
        END IF; 
			
        IF location_ = 'D' THEN 
			IF @Mission = 'T' THEN 
                call updateFlightMaterials(@Id_ );
                call sendBackSameFlight(@Id_, 0, 0, 0, 0);
                call flightReport(@StartX, @StartY, @StartPosition, @StartLocation, @EndX, @EndY, @EndPosition, @EndLocation, 'T', '1');
			END IF; 
            
            IF @Mission = 'S' THEN 
				call updateFlightMaterials(@Id_ );
                call updateFlightShips(@Id_ );
                call flightReport(@StartX, @StartY, @StartPosition, @StartLocation, @EndX, @EndY, @EndPosition, @EndtLocation, 'S', '1');
			END IF; 
            
            IF @Mission = 'R' THEN 
				call updateDebrisAndSendBack(@Id_ );
                call flightReport(@StartX, @StartY, @StartPosition, @StartLocation, @EndX, @EndY, @EndPosition, @EndLocation, 'R', '1');
            END IF; 
        END IF; 
	
		delete from Flight where Id = @Id_ ;
	END WHILE; 
    commit;
END ;;
DELIMITER ;
