CREATE DEFINER=`root`@`localhost` PROCEDURE `updateFlightShips`(id_ integer)
BEGIN
	DECLARE EXIT HANDLER FOR SQLEXCEPTION 
    BEGIN
		ROLLBACK;
		RESIGNAL;
    END;
    
	START TRANSACTION;
    
	SET @X_        = (select EndX        from Flight where Id = id_ );
    SET @Y_        = (select EndY        from Flight where Id = id_ );
    SET @Position_ = (select EndPosition from Flight where Id = id_ );
	SET @Location_ = (select EndLocation from Flight where Id = id_ );
    
    SET @NewTransporter        = (select Transporter from Flight where Id = id_ );
    SET @NewFreighter          = (select Freighter   from Flight where Id = id_ );
    SET @NewRecycler           = (select Recycler    from Flight where Id = id_ );
    SET @NewColonizer          = (select Colonizer   from Flight where Id = id_ );
    SET @NewSpySond            = (select SpySond     from Flight where Id = id_ );
    SET @NewFighter            = (select Fighter     from Flight where Id = id_ );
    SET @NewIonFighter         = (select IonFighter  from Flight where Id = id_ );
    SET @NewFrigate            = (select Frigate     from Flight where Id = id_ );
    SET @NewBomber             = (select Bomber      from Flight where Id = id_ );
    SET @NewCruiser            = (select Cruiser     from Flight where Id = id_ );
	SET @NewDrednot            = (select Drednot     from Flight where Id = id_ );
    SET @NewDestroyer          = (select Destroyer   from Flight where Id = id_ );
    SET @NewDeathStar          = (select DeathStar   from Flight where Id = id_ );
    
    IF @Location_ = 'P' THEN
		SET @Transporter = (select Transporter from Planet where X = @X_ and Y = @Y_ and Position = @Position_);
        SET @Freighter   = (select Freighter   from Planet where X = @X_ and Y = @Y_ and Position = @Position_);
        SET @Recycler    = (select Recycler    from Planet where X = @X_ and Y = @Y_ and Position = @Position_);
        SET @Colonizer   = (select Colonizer   from Planet where X = @X_ and Y = @Y_ and Position = @Position_);
        SET @SpySond     = (select SpySond     from Planet where X = @X_ and Y = @Y_ and Position = @Position_);
        SET @Fighter     = (select Fighter     from Planet where X = @X_ and Y = @Y_ and Position = @Position_);
        SET @IonFighter  = (select IonFighter  from Planet where X = @X_ and Y = @Y_ and Position = @Position_);
        SET @Frigate     = (select Frigate     from Planet where X = @X_ and Y = @Y_ and Position = @Position_);
        SET @Bomber      = (select Bomber      from Planet where X = @X_ and Y = @Y_ and Position = @Position_);
        SET @Cruiser     = (select Cruiser     from Planet where X = @X_ and Y = @Y_ and Position = @Position_);
        SET @Drednot     = (select Drednot     from Planet where X = @X_ and Y = @Y_ and Position = @Position_);
        SET @Destroyer   = (select Destroyer   from Planet where X = @X_ and Y = @Y_ and Position = @Position_);
        SET @DeathStar   = (select DeathStar   from Planet where X = @X_ and Y = @Y_ and Position = @Position_);
        
        update Planet set Transporter = @Transporter + @NewTransporter where X = @X_ and Y = @Y_ and Position = @Position_;
        update Planet set Freighter   = @Freighter   + @NewFreighter   where X = @X_ and Y = @Y_ and Position = @Position_;
        update Planet set Recycler    = @Recycler    + @NewRecycler    where X = @X_ and Y = @Y_ and Position = @Position_;
        update Planet set Colonizer   = @Colonizer   + @NewColonizer   where X = @X_ and Y = @Y_ and Position = @Position_;
        update Planet set SpySond     = @SpySond     + @NewSpySond     where X = @X_ and Y = @Y_ and Position = @Position_;
        update Planet set Fighter     = @Fighter     + @NewFighter     where X = @X_ and Y = @Y_ and Position = @Position_;
        update Planet set IonFighter  = @IonFighter  + @NewIonFighter  where X = @X_ and Y = @Y_ and Position = @Position_;
        update Planet set Frigate     = @Frigate     + @NewFrigate     where X = @X_ and Y = @Y_ and Position = @Position_;
        update Planet set Bomber      = @Bomber      + @NewBomber      where X = @X_ and Y = @Y_ and Position = @Position_;
        update Planet set Cruiser     = @Cruiser     + @NewCruiser     where X = @X_ and Y = @Y_ and Position = @Position_;
        update Planet set Drednot     = @Drednot     + @NewDrednot     where X = @X_ and Y = @Y_ and Position = @Position_;
        update Planet set Destroyer   = @Destroyer   + @NewDestroyer   where X = @X_ and Y = @Y_ and Position = @Position_;
        update Planet set DeathStar   = @DeathStar   + @NewDeathStar   where X = @X_ and Y = @Y_ and Position = @Position_;
	END IF; 
    
    IF @Location_ = 'M' THEN
		SET @Transporter = (select Transporter from Moon where X = @X_ and Y = @Y_ and Position = @Position_);
        SET @Freighter   = (select Freighter   from Moon where X = @X_ and Y = @Y_ and Position = @Position_);
        SET @Recycler    = (select Recycler    from Moon where X = @X_ and Y = @Y_ and Position = @Position_);
        SET @Colonizer   = (select Colonizer   from Moon where X = @X_ and Y = @Y_ and Position = @Position_);
        SET @SpySond     = (select SpySond     from Moon where X = @X_ and Y = @Y_ and Position = @Position_);
        SET @Fighter     = (select Fighter     from Moon where X = @X_ and Y = @Y_ and Position = @Position_);
        SET @IonFighter  = (select IonFighter  from Moon where X = @X_ and Y = @Y_ and Position = @Position_);
        SET @Frigate     = (select Frigate     from Moon where X = @X_ and Y = @Y_ and Position = @Position_);
        SET @Bomber      = (select Bomber      from Moon where X = @X_ and Y = @Y_ and Position = @Position_);
        SET @Cruiser     = (select Cruiser     from Moon where X = @X_ and Y = @Y_ and Position = @Position_);
        SET @Drednot     = (select Drednot     from Moon where X = @X_ and Y = @Y_ and Position = @Position_);
        SET @Destroyer   = (select Destroyer   from Moon where X = @X_ and Y = @Y_ and Position = @Position_);
        SET @DeathStar   = (select DeathStar   from Moon where X = @X_ and Y = @Y_ and Position = @Position_);
        
        update Moon set Transporter = @Transporter + @NewTransporter where X = @X_ and Y = @Y_ and Position = @Position_;
        update Moon set Freighter   = @Freighter   + @NewFreighter   where X = @X_ and Y = @Y_ and Position = @Position_;
        update Moon set Recycler    = @Recycler    + @NewRecycler    where X = @X_ and Y = @Y_ and Position = @Position_;
        update Moon set Colonizer   = @Colonizer   + @NewColonizer   where X = @X_ and Y = @Y_ and Position = @Position_;
        update Moon set SpySond     = @SpySond     + @NewSpySond     where X = @X_ and Y = @Y_ and Position = @Position_;
        update Moon set Fighter     = @Fighter     + @NewFighter     where X = @X_ and Y = @Y_ and Position = @Position_;
        update Moon set IonFighter  = @IonFighter  + @NewIonFighter  where X = @X_ and Y = @Y_ and Position = @Position_;
        update Moon set Frigate     = @Frigate     + @NewFrigate     where X = @X_ and Y = @Y_ and Position = @Position_;
        update Moon set Bomber      = @Bomber      + @NewBomber      where X = @X_ and Y = @Y_ and Position = @Position_;
        update Moon set Cruiser     = @Cruiser     + @NewCruiser     where X = @X_ and Y = @Y_ and Position = @Position_;
        update Moon set Drednot     = @Drednot     + @NewDrednot     where X = @X_ and Y = @Y_ and Position = @Position_;
        update Moon set Destroyer   = @Destroyer   + @NewDestroyer   where X = @X_ and Y = @Y_ and Position = @Position_;
        update Moon set DeathStar   = @DeathStar   + @NewDeathStar   where X = @X_ and Y = @Y_ and Position = @Position_;
    END IF; 
    commit;
END ;;
