CREATE DEFINER=`root`@`localhost` PROCEDURE `updateMaterials`(x_ smallint, y_ smallint, position_ smallint)
BEGIN
	DECLARE EXIT HANDLER FOR SQLEXCEPTION 
    BEGIN
		ROLLBACK;
		RESIGNAL;
    END;
    
	START TRANSACTION;
    
	SET @Metal      = (select Metal      from Planet where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_);
    SET @Cristal    = (select Cristal    from Planet where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_);
    SET @Deuter     = (select Deuter     from Planet where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_);
    SET @Antimatter = (select Antimatter from Planet where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_);
    SET @UpdateTime = (select UpdateTime from Planet where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_);
    SET @TimeDiff   = -1 * TIMESTAMPDIFF(SECOND, NOW(), @UpdateTime);
    
    SET @NewMetal      = @Metal      + (@TimeDiff * buildingProductivity(x_, y_, position_, 'P', 'MetalMine'  ) / 3600);
    SET @NewCristal    = @Cristal    + (@TimeDiff * buildingProductivity(x_, y_, position_, 'P', 'CristalMine') / 3600);
    SET @NewDeuter     = @Deuter     + (@TimeDiff * buildingProductivity(x_, y_, position_, 'P', 'DeuterExt'  ) / 3600);
    SET @NewAntimatter = @Antimatter + (@TimeDiff * buildingProductivity(x_, y_, position_, 'P', 'Accelerator') / 3600);
    SET @NewMetal      = IF(@NewMetal > buildingProductivity(x_, y_, position_, 'P', 'MetalMag'), 
						    buildingProductivity(x_, y_, position_, 'P', 'MetalMag'), 
						    @NewMetal);
	SET @NewCristal    = IF(@NewCristal > buildingProductivity(x_, y_, position_, 'P', 'CristalMag'), 
						    buildingProductivity(x_, y_, position_, 'P', 'CristalMag'), 
						    @NewCristal);
	SET @NewDeuter     = IF(@NewDeuter > buildingProductivity(x_, y_, position_, 'P', 'DeuterMag'), 
						    buildingProductivity(x_, y_, position_, 'P', 'DeuterMag'), 
						    @NewDeuter);
	SET @NewAntimatter = IF(@NewAntimatter > buildingProductivity(x_, y_, position_, 'P', 'AntimatterMag'), 
						    buildingProductivity(x_, y_, position_, 'P', 'AntimatterMag'), 
						    @NewAntimatter);
    
	update Planet set Metal      = @NewMetal      where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_;
    update Planet set Cristal    = @NewCristal    where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_;
    update Planet set Deuter     = @NewDeuter     where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_;
    update Planet set Antimatter = @NewAntimatter where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_;
    
    update Planet set UpdateTime = NOW() where Planet.X = x_ and Planet.Y = y_ and Planet.Position = position_;
    
    commit;
END ;;
DELIMITER ;
