CREATE DEFINER=`root`@`localhost` PROCEDURE `updatePlanet`(x_ smallint, y_ smallint, position_ smallint)
BEGIN
	DECLARE EXIT HANDLER FOR SQLEXCEPTION 
    BEGIN
		ROLLBACK;
		RESIGNAL;
    END;
    
	START TRANSACTION;
    
	call updateMaterials(x_, y_, position_ );
    call updateBuildingOrders(x_, y_, position_, 'P');
    call updateBuildingOrders(x_, y_, position_, 'M');
    call updateResearchOrder(x_, y_, position_ );
    call updateShipyardOrders(x_, y_, position_, 'P');
    call updateShipyardOrders(x_, y_, position_, 'M');
    call updateFlights(x_, y_, position_, 'P');
    call updateFlights(x_, y_, position_, 'M');
    call updateFlights(x_, y_, position_, 'D');
    
    commit;
END ;;
DELIMITER ;
