DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `updateResearchOrder`(x_ smallint, y_ smallint, position_ smallint)
BEGIN
	DECLARE EXIT HANDLER FOR SQLEXCEPTION 
    BEGIN
		ROLLBACK;
		RESIGNAL;
    END;
    
	START TRANSACTION;
    
	IF EXISTS(select * from Research_Order where X = x_ and Y = y_ and Position = position_ and NOW() >= End) THEN
		SET @Research = (select Item   from Research_Order where X = x_ and Y = y_ and Position = position_ limit 1);
        SET @Lvl      = (select Amount from Research_Order where X = x_ and Y = y_ and Position = position_ limit 1);
        SET @User     = (select User   from Planet         where X = x_ and Y = y_ and Position = position_);
        SET @Id       = (select Id     from Research_Order where X = x_ and Y = y_ and Position = position_);
        SET @X         = (select X        from Research_Order where Id = @Id);
        SET @Y         = (select Y        from Research_Order where Id = @Id);
        SET @Position  = (select Position from Research_Order where Id = @Id);
        SET @User      = (select User     from Planet where X = @X and Y = @Y and Position = @Position);
        
        SET @Points = (researchCost(x_, y_, position_, 'M', @Research) + 
					   researchCost(x_, y_, position_, 'K', @Research) + 
                       researchCost(x_, y_, position_, 'D', @Research) + 
                       researchCost(x_, y_, position_, 'A', @Research) ) / 1000;
		update User set ResearchPoints = ResearchPoints + @Points where Nick = @User;
        
        
		delete from Research_Order where Id = @Id;
        
        IF @Research = 'Energetic'       THEN update User set Energetic       = @Lvl where User.Nick = @User; END IF;
        IF @Research = 'Nanotechnology'  THEN update User set Nanotechnology  = @Lvl where User.Nick = @User; END IF;
        IF @Research = 'Astrophysics'    THEN update User set Astrophysics    = @Lvl where User.Nick = @User; END IF;
        IF @Research = 'Hyperspace'      THEN update User set Hyperspace      = @Lvl where User.Nick = @User; END IF;
        IF @Research = 'Astronavigation' THEN update User set Astronavigation = @Lvl where User.Nick = @User; END IF;
        IF @Research = 'Laser'           THEN update User set Laser           = @Lvl where User.Nick = @User; END IF;
        IF @Research = 'Ion'             THEN update User set Ion             = @Lvl where User.Nick = @User; END IF;
        IF @Research = 'Plasna'          THEN update User set Plasna          = @Lvl where User.Nick = @User; END IF;
        IF @Research = 'Gravitons'       THEN update User set Gravitons       = @Lvl where User.Nick = @User; END IF;
        IF @Research = 'Combat'          THEN update User set Combat          = @Lvl where User.Nick = @User; END IF;
        IF @Research = 'Shield'          THEN update User set Shield          = @Lvl where User.Nick = @User; END IF;
        IF @Research = 'Material'        THEN update User set Material        = @Lvl where User.Nick = @User; END IF;
        IF @Research = 'IonEngine'       THEN update User set IonEngine       = @Lvl where User.Nick = @User; END IF;
        IF @Research = 'HyperEngine'     THEN update User set HyperEngine     = @Lvl where User.Nick = @User; END IF;
	END IF;
    commit;
END ;;
DELIMITER ;
