DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `updateShipyardOrders`(x_ smallint, y_ smallint, position_ smallint, location_ ENUM('P','M'))
BEGIN
	DECLARE EXIT HANDLER FOR SQLEXCEPTION 
    BEGIN
		ROLLBACK;
		RESIGNAL;
    END;
    
	START TRANSACTION;
    
	WHILE EXISTS(select * from Shipyard_Order where X = x_ and Y = y_ and Position = position_ and Location = location_ and NOW() >= End) DO
		SET @Item   = (select Item   from Shipyard_Order where X = x_ and Y = y_ and Position = position_ and Location_ = location_ and NOW() >= End order by End desc limit 1);
        SET @Amount = (select Amount from Shipyard_Order where X = x_ and Y = y_ and Position = position_ and Location_ = location_ and NOW() >= End order by End desc limit 1);
        SET @Id     = (select Id     from Shipyard_Order where X = x_ and Y = y_ and Position = position_ and Location_ = location_ and NOW() >= End order by End desc limit 1);
        
        SET @Points = (@Amount * (select Metal   from Ship_Params where Item = @Item) + 
					   @Amount * (select Cristal from Ship_Params where Item = @Item) + 
                       @Amount * (select Deuter  from Ship_Params where Item = @Item) ) / 1000;
		SET @Points = IF(IS_NULL(@Points), 
					  (@Amount * (select Metal   from Defense_Params where Item = @Item) + 
					   @Amount * (select Cristal from Defense_Params where Item = @Item) + 
                       @Amount * (select Deuter  from Defense_Params where Item = @Item) ) / 1000,
                       @Points );
        
        delete from Shipyard_Order where Shipyard_Order.Id = @Id;
        
		IF location_ = 'P' THEN        
			update Planet set MilitaryPoints = MilitaryPoints + @Points where X = x_ and Y = y_ and Position = position_;
        
			IF @Item = 'RocketLauncher' THEN update Planet set RocketLauncher = RocketLauncher + @Amount where X = x_ and Y = y_ and Position = position_; END IF;
			IF @Item = 'LaserGun'       THEN update Planet set LaserGun       = LaserGun       + @Amount where X = x_ and Y = y_ and Position = position_; END IF;
            IF @Item = 'TurboLaserGun'  THEN update Planet set TurboLaserGun  = TurboLaserGun  + @Amount where X = x_ and Y = y_ and Position = position_; END IF;
            IF @Item = 'IonGun'         THEN update Planet set IonGun         = IonGun         + @Amount where X = x_ and Y = y_ and Position = position_; END IF;
            IF @Item = 'TractorGun'     THEN update Planet set TractorGun     = TractorGun     + @Amount where X = x_ and Y = y_ and Position = position_; END IF;
            IF @Item = 'PlasmaGun'      THEN update Planet set PlasmaGun      = PlasmaGun      + @Amount where X = x_ and Y = y_ and Position = position_; END IF;
            IF @Item = 'HeavyPlasmaGun' THEN update Planet set HeavyPlasmaGun = HeavyPlasmaGun + @Amount where X = x_ and Y = y_ and Position = position_; END IF;
            IF @Item = 'SolarSat'       THEN update Planet set SolarSats      = SolarSats      + @Amount where X = x_ and Y = y_ and Position = position_; END IF;
